INSERT INTO `Event` VALUES(1, 'Het dubbele huis heeft aan de achterzijde twee trapgevels in traditionele architectuur, waarvan de rechtergevel in 1954 gereconstrueerd is.');
INSERT INTO `Event` VALUES(2, 'In 1634 verkocht hij het huis aan de wapenhandelaar Louis de Geer (1587–1652).');
INSERT INTO `Event` VALUES(3, 'Diens zoon verkocht het huis in 1779.');
INSERT INTO `Event` VALUES(4, 'In 1811 vestigde kunsthandel ''''De Roos'''' zich in het pand.');
INSERT INTO `Event` VALUES(5, 'Na een restauratie in 1907 werd het gebouw van 1909 tot 1931 gebruikt door het Conservatorium van Amsterdam.');
INSERT INTO `Event` VALUES(6, 'Ter gelegenheid hiervan werd op 17 september een replica teruggehangen van het tijdens de Beeldenstorm van 1566 verdwenen Angelusklokje in het kleine torentje boven op het kerkdak.');
INSERT INTO `Event` VALUES(7, 'Daarna volgden twee kapellen die de kerk het uiterlijk van een kruiskerk gaven: de Sint Joriskapel aan de noordzijde, gebouwd in 1380-1412 (tijdens de restauratie is het jaar 1412 in een balk van het gewelf gevonden), en de Sint Sebastiaanskapel aan de zuidzijde, gebouwd in 1450-1460.');
INSERT INTO `Event` VALUES(8, 'In 1994/1998 is de kerk opnieuw gerestaureerd.');
INSERT INTO `Event` VALUES(9, 'Vanaf 1632 vonden de vergaderingen van de Kerkenraad afwisselend plaats in de Oude en Nieuwe Kerk.');
INSERT INTO `Event` VALUES(10, 'Tijdens een verbouwing in 1972 werden ten behoeve van een betere lichttoetreding de glas-in-loodramen ingekort, de originele wandbespanning in een lichtere tint vernieuwd en de oorspronkelijke wandlampen, plafonnières en lichtkroon verwijderd.');
INSERT INTO `Event` VALUES(11, 'De originele, in opengewerkt messing uitgevoerde, lichtkroon werd in 1974 herplaatst.');
INSERT INTO `Event` VALUES(12, 'In 2004 is het GVB naar elders vertrokken.');
INSERT INTO `Event` VALUES(13, 'Op 8 juni 2007 werd het gebouw na een ingrijpende verbouwing een 5 sterren deluxe hotel/restaurant/zalencentrum met 165 hotelkamers, genaamd Grand Hotel Amrâth Amsterdam.');
INSERT INTO `Event` VALUES(14, 'Op 19 november 1798 werd, op initiatief van de minister van financiën, Alexander Gogel, besloten de resterende verzameling, bestaande uit Italiaanse kunst, portretten van de Oranjes en vaderlandse rariteiten, onder te brengen in een nationaal museum naar Frans voorbeeld.');
INSERT INTO `Event` VALUES(15, 'In 1808 verhuisde het museum in opdracht van Lodewijk Napoleon naar Amsterdam, waar het vanaf 1809 samen met de kunstverzameling van Amsterdam — waaronder de Nachtwacht — werd ondergebracht op de bovenverdieping van het Paleis op de Dam.');
INSERT INTO `Event` VALUES(16, 'In 1888 is het toen als museum ingericht.');
INSERT INTO `Event` VALUES(17, 'De kerk werd in de jaren na 1243 gebouwd op basis van een vroeger kerkgebouw.');
INSERT INTO `Event` VALUES(18, 'De oorsprong van de kerk ligt bij de monniken van de Sint-Baafsabdij uit Gent, die op deze locatie in 959 een kleine kerk bouwden.');
INSERT INTO `Event` VALUES(19, 'Het paleis is na restauratie in de jaren ''70 sinds 1984 ingericht als museum.');
INSERT INTO `Event` VALUES(20, 'Sinds 1971 is het eigendom van de Staat der Nederlanden.');
INSERT INTO `Event` VALUES(21, 'Willem IV overleed in 1751 en zijn vrouw en zoon bleven in de zomer op Soestdijk wonen.');
INSERT INTO `Event` VALUES(22, 'Tijdens de Franse Oorlog werd Paleis Soestdijk in 1795 door de Franse Republiek als oorlogsbuit in beslag genomen en vervolgens aan het Nederlandse volk geschonken.');
INSERT INTO `Event` VALUES(23, 'In 1799 werd het verhuurd.');
INSERT INTO `Event` VALUES(24, 'Hij gebruikte het tot 1810, daarna werd het en van de paleizen van zijn broer, keizer Napoleon I, die Nederland dat jaar deel van het Franse Keizerrijk maakte.');
INSERT INTO `Event` VALUES(25, 'Na haar troonsafstand op 30 april 1980 bleven Juliana en Bernhard wonen op Paleis Soestdijk.');
INSERT INTO `Event` VALUES(26, 'Tot en met 2010 kwamen er in ruim vier jaar tijd meer dan 600.000 bezoekers naar Paleis Soestdijk.');
INSERT INTO `Event` VALUES(27, 'Op 1 januari 2011 werd het paleis gesloten voor publiek, maar deze sluiting werd een maand later teruggedraaid toen bleek dat de vraag naar rondleidingen groot bleef.');
INSERT INTO `Event` VALUES(28, 'In de hofzaal staat de 15.000 kg wegende ''''Christoffelschouw'''' uit 1521 ontworpen door de beeldhouwer Rombout Keldermans.');
INSERT INTO `Event` VALUES(29, 'Toen er in 1795 een einde kwam aan het markiezaat van Bergen op Zoom, legde het Franse leger beslag op het Markiezenhof en werd het paleis gebruikt als militair hospitaal.');
INSERT INTO `Event` VALUES(30, 'Vanaf 1815 werd het Markiezenhof een kazerne.');
INSERT INTO `Event` VALUES(31, 'In 1987 werd het gerenoveerde Markiezenhof door koningin Beatrix geopend.');
INSERT INTO `Event` VALUES(32, 'Van 2008 tot oktober 2009 werd het opnieuw verbouwd en werden onder meer de stijlkamers gerenoveerd.');
INSERT INTO `Event` VALUES(33, 'De molen is in 1891 gebouwd en is daarmee een zeer jonge molen vergeleken met de andere molen van Zeddam, De Grafelijke Korenmolen, die al in de 15e eeuw gebouwd is.');
INSERT INTO `Event` VALUES(34, 'In 1979 werd de molen geheel gerestaureerd.');
INSERT INTO `Event` VALUES(35, 'Sinds 1826 is de Koninklijke Militaire Academie (KMA) gevestigd in het kasteel, waardoor het kasteel niet vrij toegankelijk is voor publiek.');
INSERT INTO `Event` VALUES(36, 'Zij trouwde in 1403 met de Duitse edelman Engelbrecht I van Nassau, waardoor Breda incluis het kasteel in handen van deze voorname familie kwam.');
INSERT INTO `Event` VALUES(37, 'Op 6 september 1496, 100 jaar na de start van de bouw, was de toren af.');
INSERT INTO `Event` VALUES(38, 'Op 3 mei 1536 sloeg het noodlot toe: tijdens de Delftse stadsbrand, die vermoedelijk door blikseminslag in de toren van de Nieuwe Kerk ontstond, raakte de kerk zwaar beschadigd.');
INSERT INTO `Event` VALUES(39, 'In 1872 werd deze spits, opnieuw na een blikseminslag, vervangen door de huidige naar een ontwerp van Pierre Cuypers.');
INSERT INTO `Event` VALUES(40, 'Ongeveer in 1586 werd de toren van de kerk door Simon Stevin en toekomstig burgemeester Jan Cornets de Groot gebruikt om een valproef te doen met twee loden bollen, de één tien keer zo zwaar als de andere, waarbij bleek dat ze beiden gelijk ("dat haer beyde gheluyden een selue clop schijnt te wesen") op de grond vielen.');
INSERT INTO `Event` VALUES(41, 'In 1654 raakte de Nieuwe Kerk opnieuw zwaar beschadigd; deze keer door de Delftse donderslag, een ontploffing in het Delftse kruithuis, destijds gevestigd aan de Paardenmarkt.');
INSERT INTO `Event` VALUES(42, 'Alyd Busers (overleden in 1409) was een rijke weduwe die zich aan het eind van de veertiende eeuw — samen met haar dochter Aechte — aansloot bij een groep Delftse zusters.');
INSERT INTO `Event` VALUES(43, 'In 1403 nam deze groep een huis aan de Oude Delft in gebruik als klooster.');
INSERT INTO `Event` VALUES(44, 'In 1572 kwam de kerk in handen van de protestanten.');
INSERT INTO `Event` VALUES(45, 'Misschien was de verheffing tot kapittelkerk in 1367 aanleiding tot grootscheepse nieuwbouw.');
INSERT INTO `Event` VALUES(46, 'Rond 1470 had de kerk haar huidige vorm.');
INSERT INTO `Event` VALUES(47, 'De toren, ontworpen door Antoon I Keldermans, werd gebouwd vanaf circa 1504 maar zij is nooit geheel voltooid.');
INSERT INTO `Event` VALUES(48, 'De kerk is voor het laatst van 1982 tot 1987 geheel gerestaureerd.');
INSERT INTO `Event` VALUES(49, 'De oudste steen is gedateerd uit 1460.');
INSERT INTO `Event` VALUES(50, 'Op een van de panelen staat 1542, maar toen de kerk aan de hervormden werd overgedragen, in 1572, was het laatste paneel nog niet klaar.');
INSERT INTO `Event` VALUES(51, 'De eerste steen werd gelegd op 24 juni 1591.');
INSERT INTO `Event` VALUES(52, 'Het gemaal is in 1855 gebouwd om de Mastenbroekerpolder te bemalen.');
INSERT INTO `Event` VALUES(53, 'In 1491 werd de woning gesplitst in twee afzonderlijke panden.');
INSERT INTO `Event` VALUES(54, 'Vermoedelijk is het oorspronkelijke huis verwoest bij de stadsbrand van 1527.');
INSERT INTO `Event` VALUES(55, 'De huidige bebouwing dateert van ongeveer 1530.');
INSERT INTO `Event` VALUES(56, 'In 1560 was Mr.');
INSERT INTO `Event` VALUES(57, 'IJsbrant Cornelisz, chirurgijn eigenaar van het pand; hij verhuurde het aanvankelijk aan en verkocht het later aan zijn collega chirurgijn Mr Willem Heijndricxz Vossenburgh en deze verkocht het in 1585 weer aan Herck Jansz, een schoenmaker.');
INSERT INTO `Event` VALUES(58, 'Hoewel het huis rond 1530 gebouwd werd zijn de trapgevel en de onderpui in een latere periode weer gewijzigd.');
INSERT INTO `Event` VALUES(59, 'In 1973 is de woning door de “Vereniging Hendrick de Keyser” gerestaureerd, waarbij niet geprobeerd is het gebouw in de oorspronkelijke staat te herstellen, maar getracht is om te laten zien welke bouwkundige wijzigingen er in de loop der tijd hebben plaatsgevonden.');
INSERT INTO `Event` VALUES(60, 'Deze gaf in 1732 het paleis terug aan de Oranjes.');
INSERT INTO `Event` VALUES(61, 'Het gebouw deed dienst als gevangenis tijdens de omwenteling in 1795 en drie jaar later onder het Uitvoerend Bewind.');
INSERT INTO `Event` VALUES(62, 'Sinds 1981 woont Koningin Beatrix, toen met haar gezin, in het paleis.');
INSERT INTO `Event` VALUES(63, 'Ze werden van 1648 en 1651 uitgevoerd door een aantal schilders die daartoe waren geselecteerd door Jacob van Campen en Constantijn Huygens in samenwerking met de weduwe van Frederik Hendrik, Amalia van Solms.');
INSERT INTO `Event` VALUES(64, 'De herbouw werd voltooid in 1720.');
INSERT INTO `Event` VALUES(65, 'De bouw werd voltooid in 1656.');
INSERT INTO `Event` VALUES(66, 'Mesdag en zijn vrouw hadden geen kinderen meer sinds hun enige zoon Klaas in 1871 was overleden.');
INSERT INTO `Event` VALUES(67, 'In 2008 werd het 13e venster van de watercanon van Nederland aan het Panorama Mesdag gewijd.');
INSERT INTO `Event` VALUES(68, 'In 1826 werd het daarom vervangen door een stenen gebouw.');
INSERT INTO `Event` VALUES(69, 'De bouw startte in 1785 en werd in 1789 voltooid.');
INSERT INTO `Event` VALUES(70, 'Op 20 augustus 1808 kocht hij Welgelegen dat hij van Landhuis omdoopte in Paviljoen Welgelegen.');
INSERT INTO `Event` VALUES(71, 'In 1814 - na het vertrek van de Fransen - kwam het pand in handen van het Koninkrijk der Nederlanden.');
INSERT INTO `Event` VALUES(72, 'Het gemaal is daarna nooit gemoderniseerd en is in 1933 buiten werking gesteld.');
INSERT INTO `Event` VALUES(73, 'Al in 1880 moest Johan Jacob zijn werk - vanwege gezondheidsredenen - neerleggen.');
INSERT INTO `Event` VALUES(74, 'Hij overleed op 21 september 1881.');
INSERT INTO `Event` VALUES(75, 'Zijn vrouw Paulina stierf op 1 juni 1923 kinderloos.');
INSERT INTO `Event` VALUES(76, 'De kathedraal kreeg op 22 juni 1929 de eretitel basiliek.');
INSERT INTO `Event` VALUES(77, 'De bouw hiervan startte vermoedelijk in 1220 en duurde tot 1340.');
INSERT INTO `Event` VALUES(78, 'Rond 1370, mogelijk na de verheffing tot kapittelkerk, begon men deze kerk echter geleidelijk aan te vervangen door een nieuwe kerk in gotische stijl.');
INSERT INTO `Event` VALUES(79, 'Van 1480 tot 1496 is de weelderige H.');
INSERT INTO `Event` VALUES(80, 'In 1505 is de romaanse kerk, uitgezonderd delen van de romaanse toren, afgebroken.');
INSERT INTO `Event` VALUES(81, 'Keizer Napoleon Bonaparte was in mei 1810 in ''s-Hertogenbosch.');
INSERT INTO `Event` VALUES(82, 'Een groot verlies voor de kerk betekende ook de verkoop in 1866 van het marmeren oksaal uit 1611 dat nu te zien is in het Victoria and Albert Museum in Londen.');
INSERT INTO `Event` VALUES(83, 'Willem Claesz had daar reeds in 1487 een complex huizen gekocht.');
INSERT INTO `Event` VALUES(84, 'De ruzie werd in 1507 beslecht, waarna de stichting pas officieel plaatsvond.');
INSERT INTO `Event` VALUES(85, 'Bijzonder aan de kapel is dat het interieur de Beeldenstorm van 1566 ongeschonden heeft overleefd.');
INSERT INTO `Event` VALUES(86, 'Het leeuwendeel van de collectie bestaat uit de nalatenschap van de 17e-eeuwse geleerde Joannes Thysius (1622-1653), in de vorm van ongeveer 2500 boeken en duizenden pamfletten.');
INSERT INTO `Event` VALUES(87, 'Het belang voor de scheepvaart nam verder af door het nieuwe, westelijker gelegen, Prinses Margrietkanaal met de Prinses Margrietsluis (1951).');
INSERT INTO `Event` VALUES(88, 'Op 14 mei 1985 werd de kerk door paus Johannes Paulus II tot basiliek (Basilica Minor) verheven.');
INSERT INTO `Event` VALUES(89, 'Deze toren ging in 1955 door brand verloren, waarbij een deel van de toren door het dak van het middenschip stortte.');
INSERT INTO `Event` VALUES(90, 'Pas in 1767 kreeg de klokkengieter Andreas Jozef van den Gheyn uit Leuven opdracht om een nieuwe beiaard te gieten van veertig klokken.');
INSERT INTO `Event` VALUES(91, 'De beiaard werd in 1770 geleverd.');
INSERT INTO `Event` VALUES(92, 'In 1935 keerde het stokkenklavier weer terug en werd de beiaard gerestaureerd.');
INSERT INTO `Event` VALUES(93, 'Maar op 9 september 1955 ging het Servaascarillon verloren bij de brand van de middentoren.');
INSERT INTO `Event` VALUES(94, 'Jenneskens dit te duur vond, werd besloten om in 1959 een eigen klokkenluidersgilde op te richten.');
INSERT INTO `Event` VALUES(95, 'De poort dateert van 1229 en is daarmee de oudste nog bestaande stadspoort van Nederland.');
INSERT INTO `Event` VALUES(96, 'Op 3 augustus 1773 wordt het orgel in gebruik genomen.');
INSERT INTO `Event` VALUES(97, 'Nadat in 1992 de aardbeving bij Roermond de twee koortorens zwaar had beschadigd werden ze volgens Cuypers’ plannen herbouwd.');
INSERT INTO `Event` VALUES(98, 'Rams Woerthe gebouwd in Art Nouveau-stijl (oftewel ''''Jugendstil'''') kwam in 1899 gereed.');
INSERT INTO `Event` VALUES(99, 'Uit C14-datering bleek dat de mummie uit omstreeks 1640 stamt.');
INSERT INTO `Event` VALUES(100, 'Deze gravin van Strijen heeft, samen met haar man Ansfried, de abdij van Thorn gesticht in 992.');
INSERT INTO `Event` VALUES(101, 'De Utrechtse Dom is ondanks het ontbrekende schip en de ernstige vernielingen die de overgang naar het Protestantisme rond 1578-1580 met zich meebracht, een van de belangrijkste gotische monumenten in Nederland.');
INSERT INTO `Event` VALUES(102, 'Waar de Sint-Maartenskerk van Willibrord precies heeft gestaan is nog volop onderwerp van discussie; opgravingen op het Domplein in 1929, 1936 en 1993 hebben nog geen uitsluitsel gegeven.');
INSERT INTO `Event` VALUES(103, 'De Dom van Adelbold werd in 1131 en 1148 bij stadsbranden gehavend.');
INSERT INTO `Event` VALUES(104, 'Bij de tweede brand was de schade kennelijk aanzienlijk, want de kerk werd pas op 22 juli 1173, de feestdag van Maria Magdalena, opnieuw ingewijd.');
INSERT INTO `Event` VALUES(105, 'Rond 1295 was de kooromgang gereed.');
INSERT INTO `Event` VALUES(106, 'Dit gedeelte van de Dom werd rond 1320 voltooid.');
INSERT INTO `Event` VALUES(107, 'De aandacht ging in deze tijd echter vooral uit naar de ontzaglijke toren, die van 1321 tot 1382 werd opgetrokken.');
INSERT INTO `Event` VALUES(108, 'Kort na 1400 kwamen de werkzaamheden tijdelijk goeddeels stil te liggen.');
INSERT INTO `Event` VALUES(109, 'De situatie rond 1460 is vastgelegd op de achtergrond van een anoniem drieluik in het Centraal Museum te Utrecht dat de Kruisiging voorstelt (zie afbeelding).');
INSERT INTO `Event` VALUES(110, 'Een nieuw paleis voor de bisschop was ondertussen in 1447 in gebruik genomen ten zuidwesten van de Domtoren.');
INSERT INTO `Event` VALUES(111, 'Al in 1495 werd het grote kapittelhuis verbouwd, waarbij de tussenvloer gesloopt werd zodat er één monumentale ruimte ontstond.');
INSERT INTO `Event` VALUES(112, 'In 1496 werd de sacristie oostwaarts uitgebreid en in 1498 werd de Domproostenkapel tegen het zuiderdwarspand toegevoegd.');
INSERT INTO `Event` VALUES(113, 'In 1517 werd het werk aan het schip gestaakt omdat de geldkraan was opgedroogd.');
INSERT INTO `Event` VALUES(114, 'Het kapittel slaagde er in 1519 nog in een stuk armbot van Sint-Maarten te verwerven, maar ook de aantrekkingskracht van de relieken was grotendeels uitgewerkt.');
INSERT INTO `Event` VALUES(115, 'Alsof er niets aan de hand was, werd in 1563 nog een nieuw koorgestoelte in de Dom geplaatst en in 1571 een nieuw orgel in gebruik genomen.');
INSERT INTO `Event` VALUES(116, 'In 1578 verkocht het kapittel zelfs een groot deel van de kerkschat in de hoop de afbouw van het schip weer vlot te trekken, maar de opbrengst was maar net toereikend om wat schulden te lenigen en achterstallig onderhoud te plegen.');
INSERT INTO `Event` VALUES(117, 'In 1566 was de eerste beeldenstorm weliswaar nog op het nippertje aan de Domkerk voorbijgegaan, maar na het zogenaamde verraad van Rennenberg op 3 maart 1580 sloeg de vlam in de pan.');
INSERT INTO `Event` VALUES(118, 'Op 15 januari 1581 werd de Dom definitief door de calvinisten in gebruik genomen en "gezuiverd" van de laatste katholieke elementen.');
INSERT INTO `Event` VALUES(119, 'Het koorgestoelte hield het langer uit, maar moest het in 1695 alsnog ontgelden.');
INSERT INTO `Event` VALUES(120, 'De Sint-Salvatorkerk, die pal ten zuiden van de Domkerk stond, trof een harder lot dan de Dom: zij werd in 1582-1587 met fundament en al gesloopt.');
INSERT INTO `Event` VALUES(121, 'Drie fraaie tekeningen van Pieter Saenredam uit 1636 in het Utrechts Archief geven een goede indruk van het interieur van de Dom in deze tijd.');
INSERT INTO `Event` VALUES(122, 'Het katholieke intermezzo was echter van korte duur, want nog vóór de aftocht van de Fransen op 23 november 1673 kwam de Domkerk weer in protestantse handen en beklom de hoogbejaarde Voetius opnieuw de kansel.');
INSERT INTO `Event` VALUES(123, 'De Utrechtse schilder Herman Saftleven maakte in 1674 en 1675 een serie documentaire tekeningen van de ruïnes die hij aan de stad verkocht en die zich tegenwoordig in het Utrechts Archief bevinden.');
INSERT INTO `Event` VALUES(124, 'Terwijl de kerk er gehavend bij stond, werd in 1676 het praalgraf voor admiraal Willem Joseph van Ghent in het koor voltooid door Rombout Verhulst.');
INSERT INTO `Event` VALUES(125, 'In 1680 werd het stoffelijk overschot van de zeeheld, die tevens Domkanunnik was, op deze plaats bijgezet.');
INSERT INTO `Event` VALUES(126, 'Een jaar eerder, in 1679, was ook de ''''dolle jonker'''' Everard Meyster in de Dom begraven.');
INSERT INTO `Event` VALUES(127, 'Onder druk van de vroedschap liet het kapittel in 1677-1682 eindelijk de hoognodige herstelwerkzaamheden uitvoeren: onder leiding van stadsarchitect Ghijsbert Theunisz.');
INSERT INTO `Event` VALUES(128, 'Toen dit rond 1730 algemeen bekend werd leidde het tot de Utrechtse homoseksuelenaffaire.');
INSERT INTO `Event` VALUES(129, 'Haar woning, het voormalige bisschopspaleis naast de Domtoren, werd in 1800 verkocht voor afbraak, en drie jaar later werd het met de grond gelijk gemaakt.');
INSERT INTO `Event` VALUES(130, 'Helaas is toen ook de naburige Heilig-Kruiskapel afgebroken, en nog in 1847 werd een van de drie door de storm van 1674 gespaard gebleven schipkapellen gesloopt.');
INSERT INTO `Event` VALUES(131, 'Rond dezelfde tijd, van 1824 tot 1831, kon dankzij de vergoeding van de overheid de kerk zelf onder handen genomen worden.');
INSERT INTO `Event` VALUES(132, 'De treurige staat van de kerk na deze ingrepen is vastgelegd in een grote maquette uit 1830 door Floris van Embden (de zoon van Johannes) in het Centraal Museum in Utrecht.');
INSERT INTO `Event` VALUES(133, 'Bij een storm op 29 november 1836 liep de lantaarn zeer zware schade op.');
INSERT INTO `Event` VALUES(134, 'Kamperdijk werd in 1875 opgevolgd door F.J.');
INSERT INTO `Event` VALUES(135, 'Nadat in 1938 nog de "puist van Suys" was gesloopt, werden alle werkzaamheden gestaakt, hoewel nog niet alles onder handen genomen was.');
INSERT INTO `Event` VALUES(136, 'De laatste grootscheepse restauratie van de Domkerk heeft plaatsgevonden van 1979 tot 1988 onder leiding van ir.');
INSERT INTO `Event` VALUES(137, 'De Domtoren werd van 1901 tot 1931 ingrijpend gerestaureerd.');
INSERT INTO `Event` VALUES(138, 'Nieuw herstel aan de Domtoren vond plaats in de jaren 1972 tot 1975 en in 1995.');
INSERT INTO `Event` VALUES(139, 'In 2004 werd, ter gelegenheid van het 750-jarig bestaan van de Domkerk, het middenschip tijdelijk herbouwd uit 260 ton steigermateriaal.');
INSERT INTO `Event` VALUES(140, 'Huidige predikant is sinds 2006 Netty de Jong-Dorland.');
INSERT INTO `Event` VALUES(141, 'Om de week wordt het concert verzorgd door de in 1971 opgerichte Domcantorij, die daarnaast de zondagse diensten opluistert.');
INSERT INTO `Event` VALUES(142, 'Domcantor is sinds 1991 Remco de Graas.');
INSERT INTO `Event` VALUES(143, 'Het liggende beeld van de bisschop, gestorven in 1317, is vervaardigd uit zwart marmer.');
INSERT INTO `Event` VALUES(144, '1340, waaronder zich oorspronkelijk beelden van de twaalf apostelen hebben bevonden.');
INSERT INTO `Event` VALUES(145, '1430 van Christus aan het kruis in de kapel van Guy van Avesnes aan de zuidzijde van het koor.');
INSERT INTO `Event` VALUES(146, 'Het poortje van de sacristie uit 1497, met beeldhouwwerk van Hendrik Bontmaker en een gesneden deur van Jan van Schayck.');
INSERT INTO `Event` VALUES(147, 'Het Heilig Graf in de kooromgang uit 1501-1507 door Gerrit Splinterszoon, geschonden tijdens de beeldenstorm, met een gehavend Christusbeeld in de tombe.');
INSERT INTO `Event` VALUES(148, 'Het cenotaaf voor bisschop George van Egmond uit 1549 in zuivere renaissancestijl, bestaande uit een boog waaronder vroeger het beeld van de knielende bisschop zal hebben gestaan.');
INSERT INTO `Event` VALUES(149, 'Fragmenten van het Renaissance koorgestoelte uit 1563 van beeldsnijder Anthonis Petersz.');
INSERT INTO `Event` VALUES(150, 'In 1951 kwamen ze dankzij een schenking terug in de kerk.');
INSERT INTO `Event` VALUES(151, 'Op de plaats waar in de middeleeuwen het hoofdaltaar stond, bevindt zich thans het praalgraf van vlootcommandant Willem Joseph van Ghent, die een belangrijke rol speelde bij de Tocht naar Chatham en op 7 juni 1672 sneuvelde in de Slag bij Solebay.');
INSERT INTO `Event` VALUES(152, 'Het monument, met het beeld van de zeeheld in wapenrusting, is een hoofdwerk van Rombout Verhulst uit 1676.');
INSERT INTO `Event` VALUES(153, 'Het is in 1795 zwaar beschadigd door de Fransgezinden en daarna gedeeltelijk gereconstrueerd.');
INSERT INTO `Event` VALUES(154, 'Grafmonument voor kanunnik Hendrik van Nellesteyn (gestorven in 1747) en zijn vrouw Stephanie (gestorven in 1735) in een plompe Lodewijk XIV-stijl.');
INSERT INTO `Event` VALUES(155, 'Gebrandschilderd glas naar ontwerp van Richard Roland Holst in de enorme vensters van het dwarsschip: het venster met de vier evangelisten uit 1926 aan de zuidzijde, en het venster met symbolen uit het Oude Testament uit 1936 aan de noordkant.');
INSERT INTO `Event` VALUES(156, 'De nieuwe bronzen toegangsdeuren van de Domkerk uit 1996 zijn van de hand van de Utrechtse beeldhouwer Theo van de Vathorst.');
INSERT INTO `Event` VALUES(157, 'Het Lochorst-triptiek met de ''''Intocht in Jeruzalem'''' van Jan van Scorel uit 1527 in het Centraal Museum is eveneens afkomstig uit de Domkerk.');
INSERT INTO `Event` VALUES(158, 'Het hing aan de noordwand van het Romaanse schip en werd, toen dit plaats moest maken voor het gotische schip, in 1481 naar de oostwand van het noorder dwarspand verplaatst.');
INSERT INTO `Event` VALUES(159, 'Het instrument werd in 1569-1571 vervangen door een nieuw orgel van Peter Jansz.');
INSERT INTO `Event` VALUES(160, 'Het huidige grote orgel in de Dom is in de jaren 1825-1831 gebouwd door de gebroeders Johan en Jonathan Bätz uit Utrecht.');
INSERT INTO `Event` VALUES(161, 'Het is in 1974-1975 volledig gerestaureerd door de gebroeders Van Vulpen, waarbij de toestand in 1831 als uitgangspunt diende.');
INSERT INTO `Event` VALUES(162, 'Het ene, uit 1796, is gebouwd door Gideon Thomas Bätz en afkomstig uit het kasteel Middachten.');
INSERT INTO `Event` VALUES(163, 'Het andere bestaat uit pijpwerk uit circa 1670 toegeschreven aan Apollonius Bosch, in 1989 geplaatst in een nieuwe kast van de gebroeders Van Vulpen.');
INSERT INTO `Event` VALUES(164, 'Ten slotte zijn er twee kistorgels, het ene in 1969 gebouwd door de firma Vierdag, het andere in 2008 door de firma Klop.');
INSERT INTO `Event` VALUES(165, 'Het neogotische toegangspoortje aan de kant van het Domplein is in 1894 gebouwd door Joseph Cuypers en versierd met een afbeelding van Sint-Maarten.');
INSERT INTO `Event` VALUES(166, 'Bij de restauratie van de kruisgang in 1876-1896 werden onder leiding van architect P.J.H.');
INSERT INTO `Event` VALUES(167, 'Daarbij werd een te zachte steensoort gebruikt, zodat alle scènes in 1958-1962 opnieuw moesten worden vervangen.');
INSERT INTO `Event` VALUES(168, 'De wandtapijten uit 1935-1941 zijn ontworpen door Willem van Konijnenburg.');
INSERT INTO `Event` VALUES(169, 'De laatste restauratie volgde in 1960-1961.');
INSERT INTO `Event` VALUES(170, 'Sinds 1979 wordt dit gedaan door het Utrechts Klokkenluiders Gilde.');
INSERT INTO `Event` VALUES(171, 'Het werd in 1859 in Parijs vervaardigd door Amédée-Philippe Borrel (1818-1887) en behoort tot de modernste en nauwkeurigste uurwerken uit die tijd.');
INSERT INTO `Event` VALUES(172, 'In 1974 werd een elektrische aandrijving aangebracht die de oorspronkelijke mechanische functies overbodig maakte.');
INSERT INTO `Event` VALUES(173, 'Na decennialange verwaarlozing is het uurwerk in 2004 gerestaureerd en de mechanische aandrijving met enige moeite in ere hersteld.');
INSERT INTO `Event` VALUES(174, 'Het blijft echter een onopgeloste vraag of de toren er in 1432 door Van Eyck zelf op is aangebracht, of dat dat is gebeurd bij een restauratie in 1550 waarbij de Utrechtse schilder Jan van Scorel betrokken was.');
INSERT INTO `Event` VALUES(175, '1450-1460, toegeschreven aan Willem Vrelant (Österreichische Nationalbibliothek, Wenen), verrijst links op de achtergrond de Domtoren.');
INSERT INTO `Event` VALUES(176, 'Erasmus'''' door een anoniem Nederlands meester uit 1474 (Society of Antiquaries, Londen).');
INSERT INTO `Event` VALUES(177, 'Aan die merkwaardige situatie is in 2003 een eind gekomen doordat van lijn 2 een ringlijn is gemaakt.');
INSERT INTO `Event` VALUES(178, 'Een kleiner model van de Domtoren (4,5 meter hoog) werd in 1983 ter gelegenheid van het 600-jarig bestaan van de toren onthuld in de miniatuurstad Madurodam.');
INSERT INTO `Event` VALUES(179, 'Op 31 mei 2007 beklommen actievoerders van Greenpeace de Domtoren aan de buitenkant.');
