INSERT INTO `Event` VALUES(191, 'De Utrechtse Dom is ondanks het ontbrekende schip en de ernstige vernielingen die de overgang naar het Protestantisme rond 1578-1580 met zich meebracht, een van de belangrijkste gotische monumenten in Nederland.');
INSERT INTO `Event` VALUES(192, 'Waar de Sint-Maartenskerk van Willibrord precies heeft gestaan is nog volop onderwerp van discussie; opgravingen op het Domplein in 1929, 1936 en 1993 hebben nog geen uitsluitsel gegeven.');
INSERT INTO `Event` VALUES(193, 'De Dom van Adelbold werd in 1131 en 1148 bij stadsbranden gehavend.');
INSERT INTO `Event` VALUES(194, 'Bij de tweede brand was de schade kennelijk aanzienlijk, want de kerk werd pas op 22 juli 1173, de feestdag van Maria Magdalena, opnieuw ingewijd.');
INSERT INTO `Event` VALUES(195, 'Rond 1295 was de kooromgang gereed.');
INSERT INTO `Event` VALUES(196, 'Dit gedeelte van de Dom werd rond 1320 voltooid.');
INSERT INTO `Event` VALUES(197, 'De aandacht ging in deze tijd echter vooral uit naar de ontzaglijke toren, die van 1321 tot 1382 werd opgetrokken.');
INSERT INTO `Event` VALUES(198, 'Kort na 1400 kwamen de werkzaamheden tijdelijk goeddeels stil te liggen.');
INSERT INTO `Event` VALUES(199, 'De situatie rond 1460 is vastgelegd op de achtergrond van een anoniem drieluik in het Centraal Museum te Utrecht dat de Kruisiging voorstelt (zie afbeelding).');
INSERT INTO `Event` VALUES(200, 'Een nieuw paleis voor de bisschop was ondertussen in 1447 in gebruik genomen ten zuidwesten van de Domtoren.');
INSERT INTO `Event` VALUES(201, 'Al in 1495 werd het grote kapittelhuis verbouwd, waarbij de tussenvloer gesloopt werd zodat er één monumentale ruimte ontstond.');
INSERT INTO `Event` VALUES(202, 'In 1496 werd de sacristie oostwaarts uitgebreid en in 1498 werd de Domproostenkapel tegen het zuiderdwarspand toegevoegd.');
INSERT INTO `Event` VALUES(203, 'In 1517 werd het werk aan het schip gestaakt omdat de geldkraan was opgedroogd.');
INSERT INTO `Event` VALUES(204, 'Het kapittel slaagde er in 1519 nog in een stuk armbot van Sint-Maarten te verwerven, maar ook de aantrekkingskracht van de relieken was grotendeels uitgewerkt.');
INSERT INTO `Event` VALUES(205, 'Alsof er niets aan de hand was, werd in 1563 nog een nieuw koorgestoelte in de Dom geplaatst en in 1571 een nieuw orgel in gebruik genomen.');
INSERT INTO `Event` VALUES(206, 'In 1578 verkocht het kapittel zelfs een groot deel van de kerkschat in de hoop de afbouw van het schip weer vlot te trekken, maar de opbrengst was maar net toereikend om wat schulden te lenigen en achterstallig onderhoud te plegen.');
INSERT INTO `Event` VALUES(207, 'In 1566 was de eerste beeldenstorm weliswaar nog op het nippertje aan de Domkerk voorbijgegaan, maar na het zogenaamde verraad van Rennenberg op 3 maart 1580 sloeg de vlam in de pan.');
INSERT INTO `Event` VALUES(208, 'Op 15 januari 1581 werd de Dom definitief door de calvinisten in gebruik genomen en "gezuiverd" van de laatste katholieke elementen.');
INSERT INTO `Event` VALUES(209, 'Het koorgestoelte hield het langer uit, maar moest het in 1695 alsnog ontgelden.');
INSERT INTO `Event` VALUES(210, 'De Sint-Salvatorkerk, die pal ten zuiden van de Domkerk stond, trof een harder lot dan de Dom: zij werd in 1582-1587 met fundament en al gesloopt.');
INSERT INTO `Event` VALUES(211, 'Drie fraaie tekeningen van Pieter Saenredam uit 1636 in het Utrechts Archief geven een goede indruk van het interieur van de Dom in deze tijd.');
INSERT INTO `Event` VALUES(212, 'Het katholieke intermezzo was echter van korte duur, want nog vóór de aftocht van de Fransen op 23 november 1673 kwam de Domkerk weer in protestantse handen en beklom de hoogbejaarde Voetius opnieuw de kansel.');
INSERT INTO `Event` VALUES(213, 'De Utrechtse schilder Herman Saftleven maakte in 1674 en 1675 een serie documentaire tekeningen van de ruïnes die hij aan de stad verkocht en die zich tegenwoordig in het Utrechts Archief bevinden.');
INSERT INTO `Event` VALUES(214, 'Terwijl de kerk er gehavend bij stond, werd in 1676 het praalgraf voor admiraal Willem Joseph van Ghent in het koor voltooid door Rombout Verhulst.');
INSERT INTO `Event` VALUES(215, 'In 1680 werd het stoffelijk overschot van de zeeheld, die tevens Domkanunnik was, op deze plaats bijgezet.');
INSERT INTO `Event` VALUES(216, 'Een jaar eerder, in 1679, was ook de ''''dolle jonker'''' Everard Meyster in de Dom begraven.');
INSERT INTO `Event` VALUES(217, 'Onder druk van de vroedschap liet het kapittel in 1677-1682 eindelijk de hoognodige herstelwerkzaamheden uitvoeren: onder leiding van stadsarchitect Ghijsbert Theunisz.');
INSERT INTO `Event` VALUES(218, 'Toen dit rond 1730 algemeen bekend werd leidde het tot de Utrechtse homoseksuelenaffaire.');
INSERT INTO `Event` VALUES(219, 'Haar woning, het voormalige bisschopspaleis naast de Domtoren, werd in 1800 verkocht voor afbraak, en drie jaar later werd het met de grond gelijk gemaakt.');
INSERT INTO `Event` VALUES(220, 'Helaas is toen ook de naburige Heilig-Kruiskapel afgebroken, en nog in 1847 werd een van de drie door de storm van 1674 gespaard gebleven schipkapellen gesloopt.');
INSERT INTO `Event` VALUES(221, 'Rond dezelfde tijd, van 1824 tot 1831, kon dankzij de vergoeding van de overheid de kerk zelf onder handen genomen worden.');
INSERT INTO `Event` VALUES(222, 'De treurige staat van de kerk na deze ingrepen is vastgelegd in een grote maquette uit 1830 door Floris van Embden (de zoon van Johannes) in het Centraal Museum in Utrecht.');
INSERT INTO `Event` VALUES(223, 'Bij een storm op 29 november 1836 liep de lantaarn zeer zware schade op.');
INSERT INTO `Event` VALUES(224, 'Kamperdijk werd in 1875 opgevolgd door F.J.');
INSERT INTO `Event` VALUES(225, 'Nadat in 1938 nog de "puist van Suys" was gesloopt, werden alle werkzaamheden gestaakt, hoewel nog niet alles onder handen genomen was.');
INSERT INTO `Event` VALUES(226, 'De laatste grootscheepse restauratie van de Domkerk heeft plaatsgevonden van 1979 tot 1988 onder leiding van ir.');
INSERT INTO `Event` VALUES(227, 'De Domtoren werd van 1901 tot 1931 ingrijpend gerestaureerd.');
INSERT INTO `Event` VALUES(228, 'Nieuw herstel aan de Domtoren vond plaats in de jaren 1972 tot 1975 en in 1995.');
INSERT INTO `Event` VALUES(229, 'In 2004 werd, ter gelegenheid van het 750-jarig bestaan van de Domkerk, het middenschip tijdelijk herbouwd uit 260 ton steigermateriaal.');
INSERT INTO `Event` VALUES(230, 'Huidige predikant is sinds 2006 Netty de Jong-Dorland.');
INSERT INTO `Event` VALUES(231, 'Om de week wordt het concert verzorgd door de in 1971 opgerichte Domcantorij, die daarnaast de zondagse diensten opluistert.');
INSERT INTO `Event` VALUES(232, 'Domcantor is sinds 1991 Remco de Graas.');
INSERT INTO `Event` VALUES(233, 'Het liggende beeld van de bisschop, gestorven in 1317, is vervaardigd uit zwart marmer.');
INSERT INTO `Event` VALUES(234, '1340, waaronder zich oorspronkelijk beelden van de twaalf apostelen hebben bevonden.');
INSERT INTO `Event` VALUES(235, '1430 van Christus aan het kruis in de kapel van Guy van Avesnes aan de zuidzijde van het koor.');
INSERT INTO `Event` VALUES(236, 'Het poortje van de sacristie uit 1497, met beeldhouwwerk van Hendrik Bontmaker en een gesneden deur van Jan van Schayck.');
INSERT INTO `Event` VALUES(237, 'Het Heilig Graf in de kooromgang uit 1501-1507 door Gerrit Splinterszoon, geschonden tijdens de beeldenstorm, met een gehavend Christusbeeld in de tombe.');
INSERT INTO `Event` VALUES(238, 'Het cenotaaf voor bisschop George van Egmond uit 1549 in zuivere renaissancestijl, bestaande uit een boog waaronder vroeger het beeld van de knielende bisschop zal hebben gestaan.');
INSERT INTO `Event` VALUES(239, 'Fragmenten van het Renaissance koorgestoelte uit 1563 van beeldsnijder Anthonis Petersz.');
INSERT INTO `Event` VALUES(240, 'In 1951 kwamen ze dankzij een schenking terug in de kerk.');
INSERT INTO `Event` VALUES(241, 'Op de plaats waar in de middeleeuwen het hoofdaltaar stond, bevindt zich thans het praalgraf van vlootcommandant Willem Joseph van Ghent, die een belangrijke rol speelde bij de Tocht naar Chatham en op 7 juni 1672 sneuvelde in de Slag bij Solebay.');
INSERT INTO `Event` VALUES(242, 'Het monument, met het beeld van de zeeheld in wapenrusting, is een hoofdwerk van Rombout Verhulst uit 1676.');
INSERT INTO `Event` VALUES(243, 'Het is in 1795 zwaar beschadigd door de Fransgezinden en daarna gedeeltelijk gereconstrueerd.');
INSERT INTO `Event` VALUES(244, 'Grafmonument voor kanunnik Hendrik van Nellesteyn (gestorven in 1747) en zijn vrouw Stephanie (gestorven in 1735) in een plompe Lodewijk XIV-stijl.');
INSERT INTO `Event` VALUES(245, 'Gebrandschilderd glas naar ontwerp van Richard Roland Holst in de enorme vensters van het dwarsschip: het venster met de vier evangelisten uit 1926 aan de zuidzijde, en het venster met symbolen uit het Oude Testament uit 1936 aan de noordkant.');
INSERT INTO `Event` VALUES(246, 'De nieuwe bronzen toegangsdeuren van de Domkerk uit 1996 zijn van de hand van de Utrechtse beeldhouwer Theo van de Vathorst.');
