INSERT INTO `Event` VALUES(250, 'Het huidige grote orgel in de Dom is in de jaren 1825-1831 gebouwd door de gebroeders Johan en Jonathan Bätz uit Utrecht.');
INSERT INTO `Event` VALUES(251, 'Het is in 1974-1975 volledig gerestaureerd door de gebroeders Van Vulpen, waarbij de toestand in 1831 als uitgangspunt diende.');
