INSERT INTO `Event` VALUES(281, 'Ook Gosewijn II kwam enkele keren in conflict met de Duitse keizer, wat in 1141 resulteerde in de verwoesting van het kasteel en het stadje.');
INSERT INTO `Event` VALUES(282, 'Omstreeks 1200 werd een tienhoekige toren gebouwd ter vervanging van de veel grotere zestienhoekige toren.');
INSERT INTO `Event` VALUES(283, 'Omstreeks 1250 stond er een complex waar de huidige putkamer, een deel van de huidige kapel en een voorloper van de huidige ridderzaal deel van uitmaken.');
INSERT INTO `Event` VALUES(284, 'In de Tachtigjarige Oorlog wisselde het kasteel enkele keren van eigenaar, maar de staatse troepen wisten de burcht in 1644 definitief in handen te krijgen.');
INSERT INTO `Event` VALUES(285, 'In december 1672 werd het kasteel kortstondig bezet door Franse troepen, maar zij werden al weer snel verdreven.');
INSERT INTO `Event` VALUES(286, 'In 1890 werden twee vrijstaande gebouwtjes aan de zijkanten gesloopt om plaats te maken voor langere vleugels.');
INSERT INTO `Event` VALUES(287, 'In 2005 werd het station verpacht en in oude staat teruggebracht.');
INSERT INTO `Event` VALUES(288, 'Tussen 1465 en 1561 werd gewerkt aan de bouw van het klooster volgens een middeleeuws plan.');
INSERT INTO `Event` VALUES(289, 'Stormen, brand en hoge onderhoudskosten zorgden voor grote problemen in de eeuwen na 1600.');
INSERT INTO `Event` VALUES(290, 'Het statige klooster onderging daardoor helaas veel aanpassingen tot 1930.');
INSERT INTO `Event` VALUES(291, 'De westgevel werd na 1755 gesloopt.');
INSERT INTO `Event` VALUES(292, 'De bovenverdieping met de cellen van de Kruisheren onderging in 1834 hetzelfde lot evenals de bouwvallig geworden gewelven in de kerk (1837).');
INSERT INTO `Event` VALUES(293, 'Onder leiding van de Deense architect Johannes Exner werd medio 2000 begonnen met de bouw van de nieuwe westvleugel en uitvoering gegeven aan het restauratieplan van OVT architecten uit Groningen.');
INSERT INTO `Event` VALUES(294, 'In september 2001 werd het werk opgeleverd.');
INSERT INTO `Event` VALUES(295, 'Het was een belangrijke spil rond de Tachtigjarige Oorlog, tussen 1560 en 1575 werd het fort een aantal keren veroverd.');
INSERT INTO `Event` VALUES(296, 'In 1787 kwam op de binnenplaats van het fort een hospitaal voor zieke bemanningsleden van de schepen van de Verenigde Oostindische Compagnie (VOC) die voor de kust lagen te wachten op gunstige wind.');
INSERT INTO `Event` VALUES(297, 'Het oude schip verdwijnt rond 1500 om plaats te maken voor het huidige driebeukige schip dat de vorm kreeg van een gotische hallenkerk.');
INSERT INTO `Event` VALUES(298, 'Deze wordt in 1512 opnieuw in gebruik genomen.');
INSERT INTO `Event` VALUES(299, 'Met de bouw van de toren in Kempense gotiek wordt gestart in 1528.');
INSERT INTO `Event` VALUES(300, 'Pas in 1887 wordt de toren voltooid naar een ontwerp van architect Johannes Kayser uit Venlo.');
INSERT INTO `Event` VALUES(301, 'In 1940 stort de 60 meter hoge houten spits naar beneden en vernielt een aantal gewelven van de kerk.');
INSERT INTO `Event` VALUES(302, 'Pas in 1951 schrijft het kerkbestuur een prijsvraag uit voor een nieuw ontwerp voor de torenbekroning.');
INSERT INTO `Event` VALUES(303, 'In 1893 schonk de gemeente Zwolle de Sassenpoort aan de Staat der Nederlanden, om er het rijksarchief in onder te brengen.');
INSERT INTO `Event` VALUES(304, 'Wiebenga, is een schoolvoorbeeld van het Nieuwe Bouwen en is gebouwd tussen 1927 en 1930.');
INSERT INTO `Event` VALUES(305, ' 1932       Een van de grote voordenkers van het  en tevens een van de belangrijkste archtitecten van de twintigste eeuw, de Zwitser Le Corbusier bezoekt de Van Nellefabriek en toont zich enthousiast in zijn commentaar: ''''"U heeft in Rotterdam een schitterend bewijs van het leven dat komt!');
INSERT INTO `Event` VALUES(306, 'Het complex werd in 1884 voltooid en kan als het eerste in Nederland worden gezien.');
INSERT INTO `Event` VALUES(307, 'Omdat dit de Hertog van Gelre een doorn in het oog was viel hij in 1427 het kasteel aan en verwoeste het.');
INSERT INTO `Event` VALUES(308, 'In het Rampjaar (1672) werd het kasteel door de Fransen leeggeplunderd en in brand gestoken.');
INSERT INTO `Event` VALUES(309, 'Graaf Godard van Aldenburg Bentinck kreeg het huis in 1879 in handen.');
