INSERT INTO `Monument` VALUES(437, 4, 'Beurs van Berlage', 'De Beurs (Beursplein 1-3) kwam in 1898-1903 na een prijsvraag tot stand naar een rationalistisch ontwerp van H.P. Berlage ter plaatse van een daartoe in 1883 gedempt gedeelte van het Damrak en ter vervanging van beursgebouwen uit 1608-''11 en 1840-''45. Een hiertoe in 1883 uitgeschreven prijsvraag werd door L.M. Cordonnier gewonnen, maar vanwege een beschuldinging van plagiaat kwam het niet tot uitvoering. Ook pogingen tot renovatie van de oude beurs mislukten, waarna Berlage vanaf 1896 aan een nieuwbouwplan ging werken. Het imposante, langgerekte gebouw wordt geaccentueerd door in hoogte verspringende torenvormige volumes (trappenhuizen). De strakke bakstenen gevels hebben grote vensterreeksen. Zowel uitals inwendig ligt de nadruk op het eerlijk tonen van het bouwmateriaal en de constructie.', 52.3746, 4.89575, 'Amsterdam', 'Noord-Holland', 'Beursplein', '1-387', '1898-1902', 1902, 'Beurs van Berlage', '{"beursgebouwen": 1, "plagiaat": 1, "langgerekte": 1, "maar": 1, "beschuldinging": 1, "gebouw": 1, "door": 2, "amsterdam": 1, "vensterreeksen": 1, "vanaf": 1, "daartoe": 1, "ontwerp": 1, "werd": 1, "1898-1903": 1, "het": 5, "gedeelte": 1, "constructie": 1, "ligt": 1, "waarna": 1, "1608-''11": 1, "vanwege": 1, "gevels": 1, "tonen": 1, "uitgeschreven": 1, "op": 1, "een": 6, "ook": 1, "pogingen": 1, "1896": 1, "berlage": 3, "aan": 1, "hoogte": 1, "h.p": 1, "1840-''45": 1, "torenvormige": 1, "uit": 1, "plaatse": 1, "geaccentueerd": 1, "hiertoe": 1, "uitvoering": 1, "renovatie": 1, "eerlijk": 1, "uitals": 1, "kwam": 2, "ter": 2, "1-3": 1, "imposante": 1, "gewonnen": 1, "van": 8, "naar": 1, "zowel": 1, "volumes": 1, "verspringende": 1, "1883": 2, "de": 5, "gedempt": 1, "damrak": 1, "tot": 3, "grote": 1, "wordt": 1, "nadruk": 1, "bakstenen": 1, "beurs": 3, "hebben": 1, "ging": 1, "nieuwbouwplan": 1, "vervanging": 1, "bouwmateriaal": 1, "oude": 1, "beursplein": 1, "rationalistisch": 1, "in": 4, "niet": 1, "inwendig