INSERT INTO `Monument` VALUES(2975, 10, 'Trippenhuis', 'Het classicistische herenhuis Kloveniersburgwal 95 kwam in 1642 tot stand voor Joan Poppen naar plannen van Philips Vingboons. Boven het met hardsteen beklede souterrain hebben de twee bouwlagen een gevelbekleding in zandsteen met kolossale corinthische pilasters. Het middenrisaliet wordt bekroond door een driehoekig fronton. De hoofdingang heeft men in 1904 verplaatst van de bel-etage (met stoep) naar het souterrain. Eveneens ontworpen door Philips Vingboons zijn de classicistische herenhuizen De Star (Kloveniersburgwal 77; 1650), gebouwd voor wolhandelaar Nicolaas Bambeeck, en De Ladder Jacobs (OZ Voorburgwal 316; 1655), gebouwd voor Pieter de Mayer bij diens suikerraffinaderij. Beide huizen worden bekroond door een fronton en hebben dorische pilasters bij de bel-etage en kolossale ionische pilasters bij de verdiepingen. Het vier travee&euml;n brede huis &lsquo;De Star&rsquo; is het resultaat van de samenvoeging van twee even brede bestaande panden. Hierdoor is de ingang uit het midden geplaatst en heeft de gevel tegen de regels in een pilaster in het midden (net als het huis Bartolotti). Tot de latere Vingboons-ontwerpen van herenhuizen met pilastergevels behoren Herengracht 386 (1663-''65) en Herengracht 412 (1664-''67). Bij het laatste is de zandstenen voorgevel uitgevoerd door steenhouwer Pieter Pietersz van Kuijck. Het huidige attiek met zoldervensters is begin 19de eeuw toegevoegd. Amsterdam, Herenhuis Kloveniersburgwal 95 Achter dit huis staat een groot tuinhuis in Lodewijk XIV-stijl (circa 1740). Het imposante Trippenhuis (Kloveniersburgwal 29) verrees in 1660-''62 naar ontwerp van Justus Vingboons als dubbelhuis voor de broers Louis en Hendrick Trip, die in Zweden fortuin hadden gemaakt met ijzer- en kopermijnen, smederijen en geschutsgieterijen. De classicistische pilastergevel heeft boven het hoge en vlakke hardstenen basement (met ingangen) twee met zandsteen beklede verdiepingen en een mezzanino voorzien van gecanneleerde kolossale pilasters met corinthische kapitelen. De gevel is rijk gedecoreerd met ranken, bloemen, festoenen en putti. Het bekronend fronton van het middenrisaliet toont het wapenschild van de familie (drie trippen), omringd door kanonskogels en kanonslopen. De hoekschoorstenen hebben de vorm van mortieren (gereconstrueerd 1890). Het beeldhouwwerk is van Jan Gijseling sr. en Hendrick de Keyser de Jonge. Sinds 1814 huisvest het gebouw het Koninklijk Instituut van Wetenschappen, Letteren en Kunst (nu N.W.O.). Na een verbouwing door stadsbouwmeester Abraham van der Hart (1815-''17) was een deel van het gebouw geschikt als Rijksmuseum van Schilderijen (collectie in 1885 naar Rijksmuseum). De toen ontstane samenvoeging van de voor- en achterzalen van beide huizen heeft men ongedaan gemaakt bij een restauratie in 1988-''91. Vanwege de symmetrie van de gevel loopt de scheidingsmuur van de twee huisdelen in afgeschuinde vorm recht op Amsterdam, Trippenhuis het middelste venster aan. Er resteren nog veel originele interieuronderdelen, waaronder in de grote zaal van het linker deel een cassetteplafond met schilderingen van Nicolaas van Helt Stockade. Ook elders in het gebouw zijn plafondschilderingen van hem behouden. In de gangen van de beide delen bevinden zich bovendeurstukken van Allard van Everdingen. Het rechterhuis werd in 1730 in Lodewijk XIV-stijl verbouwd voor Elisabeth van Loon.', 52.3712, 4.89939, 'Amsterdam', 'Noord-Holland', 'Kloveniersburgwal', '29', '1660-1662', 1662, NULL, '{"steenhouwer": 1, "stockade": 1, "1988-''91": 1, "amsterdam": 3, "plafondschilderingen": 1, "n.w.o": 1, "hardstenen": 1, "schilderingen": 1, "voor-": 1, "huizen": 2, "deel": 2, "vanwege": 1, "instituut": 1, "gebouwd": 2, "gereconstrueerd": 1, "verbouwing": 1, "ontworpen": 1, "basement": 1, "bartolotti": 1, "latere": 1, "29": 1, "bekroond": 2, "veel": 1, "1814": 1, "achterzalen": 1, "vier": 1, "bij": 5, "imposante": 1, "wapenschild": 1, "trippen": 1, "huidige": 1,