INSERT INTO `Monument` VALUES(3403, NULL, 'American hotel', 'Het American Hotel (Leidseplein 28) werd in 1898-1902 naar ontwerp van W. Kromhout en W.G. Jansen gebouwd in opdracht van A. Volmer ter plaatse van een hotel uit 1879-''82. Naast een hotel bevat het gebouw ook caf&eacute;-restaurant &lsquo;Americain&rsquo; en op de verdieping een feestzaal. Het in gele baksteen opgetrokken gebouw vertoont rationalistische elementen, jugendstil-details en verwijzingen naar Moorse en Venetiaanse architectuur. De tegeltableaus met voorstellingen van flora en fauna zijn vervaardigd door aardewerkfabriek &lsquo;De Distel&rsquo; naar ontwerp van L. Nienhuis. Kromhout ontwierp ook een deel van de inrichting, zoals de stoelen en de lampen. De gebrandschilderde ramen in de grote caf&eacute;zaal zijn uit de bouwtijd. In 1927-''28 voegde G.J. Rutgers de vleugel aan de Leidsekade toe (beeldhouwwerk Th. Vos) en kreeg het caf&eacute; een inrichting in art d&eacute;co-stijl (lichtornamenten, J. Eisenloeffel) en zijn er wandschilderingen aangebracht. Er volgden nog een uitbreiding (1954) en een renovatie (1985-''88). In opdracht van F. Schiller verrees het Hotel Schiller (Rembrandtplein 26-36; 1914-''15, M.J.E. Lippits en N.H.W. Scholte) in Nieuw Historiserende stijl met neorenaissance- en rationalistische elementen. Op de begane grond bevindt zich het &lsquo;Caf&eacute; Schiller&rsquo;, trefpunt van artistiek Amsterdam. In 1950 heeft men het hotel gemoderniseerd, maar bij een restauratie (1977) is het toen verwijderde jugendstil-interieur van de Schillerbar hersteld. Het forse complex van het Carlton Hotel (Vijzelstraat 2-18; 1925-''29, G.J. Rutgers) , tegenwoordig &lsquo;Jolly Hotel&rsquo;, vertoont een combinatie van expressionistische en rationalistische vormen. Karakteristiek is de galerij met betonnen pijlers bij de begane grond; de bakstenen gevels erboven zijn versierd met natuurstenen beeldhouwwerk (Th.A. Vos). Hotel IBIS (Stationsplein 49; 1988-''92, J. Benthem en M. Crouwel) heeft een golvende gevel bestaande uit prefab-elementen met glazen bouwstenen. Uit dezelfde tijd en ontworpen door dezelfde architecten is de naastgelegen ronde kantoortoren.', 52.3639, 4.88116, 'Amsterdam', 'Noord-Holland', 'Leidseplein', '28-97', NULL, NULL, NULL, '{"opgetrokken": 1, "jugendstil-interieur": 1, "stoelen": 1, "tegeltableaus": 1, "leidseplein": 1, "fauna": 1, "distel&rsquo": 1, "natuurstenen": 1, "1988-''92": 1, "door": 2, "amsterdam": 2, "uitbreiding": 1, "combinatie": 1, "1898-1902": 1, "1977": 1, "het": 10, "deel": 1, "aangebracht": 1, "nieuw": 1, "1925-''29": 1, "1985-''88": 1, "grond": 2, "g.j": 2, "ronde": 1, "gebouwd": 1, "zaal": 1, "bouwstenen": 1, "ontworpen": 1, "forse": 1, "op": 2, "nog": 1, "stijl": 1, "ook": 2, "naast": 1, "versierd": 1, "m.j.e": 1, "vervaardigd": 1, "art": 1, "1879-''82": 1, "venetiaanse": 1, "aan": 1, "rationalistische": 3, "28": 1, "26-36": 1, "baksteen": 1, "jolly": 1, "nienhuis": 1, "erboven": 1, "tegenwoordig": 1, "bij": 2, "schiller&rsquo": 1, "complex": 1, "naar": 3, "trefpunt": 1, "&lsquo": 4, "verdieping": 1, "de": 17, "hotel&rsquo": 1, "american": 2, "bevat": 1, "lampen": 1, "bakstenen": 1, "inrichting": 2, "feestzaal": 1, "scholte": 1, "pijlers": 1, "co-stijl": 1, "f": 1, "moorse": 1, "d&eacute": 1, "gevel": 1, "rembrandtplein": 1, "artistiek": 1, "kromhout": 2, "flora": 1, "opdracht": 2, "expressionistische": 1, "toen": 1, "a": 1, "1927-''28": 1, "volgden": 1, "architectuur": 1, "l": 1, "m": 1, "j": 2, "w.g": 1, "begane": 2, "w": 1, "heeft": 2, "hersteld": 1, "restauratie": 1, "vijzelstraat": 1, "en": 14, "golvende": 1, "er": 2, "naastgelegen": 1, "prefab-elementen": 1, "bestaande": 1, "maar": 1, "glazen": 1, "gebouw": 2, "2-18": 1, "verrees": 1, "vertoont": 2, "crouwel": 1, "beeldhouwwerk": 2, "th": 1, "dezelfde": 2, "ontwerp": 2, "werd": 1, "bevindt": 1, "gevels": 1, "americain&rsquo": 1, "een": 10, "kreeg": 1, "neorenaissance-": 1, "vleugel": 1, "caf&eacute": 4, "lippits": 1, "leidsekade": 1, "schillerbar":