INSERT INTO `Monument` VALUES(5499, 9, 'Huizenblok', 'De in 1906 erkende co&ouml;peratieve woningbouwvereniging &lsquo;Rochdale&rsquo; was de eerste die woningwetwoningen (zonder alkoven en bedsteden) liet bouwen, zoals de met rationalistische details uitgevoerde woningen Van Beuningenstraat 97-109 (1909, J.E. van der Pek). Andere verenigingen volgden, waaronder de Alg. Woningbouw Vereniging (1910), &lsquo;Eigen Haard&rsquo; (1910), &lsquo;Het Westen&rsquo; (1911) en &lsquo;Het Oosten&rsquo; (1912). Verder waren er de verenigingen &lsquo;Dr. Schaepman&rsquo; (1909; katholiek), &lsquo;Patrimonium&rsquo; (1911; protestant) en &lsquo;De Dageraad&rsquo; (1916; socialistisch). Voor de toenmalige &lsquo;Arbeidersco&ouml;peratie De Dageraad&rsquo; ontwierp J.W.F. Hartkamp samen met H.P. Berlage het woningblok Toldwarsstraat 107 (1907-''08). Naar plannen van K.P.C. de Bazel kwamen de gesloten woningblokken De Kempenaerstraat e.o. (1914-''18) en Zaandammerplein e.o. (1918-''23) tot stand. Deze vallen op door het terugspringen van de hoeken. Kenmerkend is ook de Zaanhof (Zaanstraat 1-134; 1918, H.J.M. Walenkamp) met poortwoningen en gepleisterde gevelzones. Op initiatief van de wethouder voor volkshuisvesting F.M. Wibaut werd in 1915 de Gemeentelijke Woningdienst opgericht met A. Keppler als eerste directeur. Samen met de woningbouwverenigingen probeerde Keppler een programma voor woningwetwoningen van de grond te krijgen in een periode van sterk stijgende bouwkosten (die pas na 1920 weer afnamen). De rijkste uitingen van deze sociale woningbouw zijn uitgevoerd in een plastische expressionistische stijl, die vaak wordt aangeduid als de Amsterdamse School. Het exterieur van het bouwblok werd als &eacute;&eacute;n plastisch geheel gezien in plaats van een voortdurende herhaling van basisvormen. In zijn meest uitbundige vorm is dit zichtbaar bij het zogeheten Derde Blok aan het Spaarndammerplantsoen (1917-''20), ook wel het &lsquo;Schip&rsquo; genoemd. Dit door M. de Klerk voor &lsquo;Eigen Haard&rsquo;  Amsterdam, Derde Blok Spaarndammerplantsoen ontworpen &lsquo;burchtachtige&rsquo; complex heeft aan de zijde van de Hembrugstraat (nrs. 257-305) een terugspringend gedeelte met plastisch siermetselwerk, tonvormige hoekerkers en als stedenbouwkundig accent een met dakpannen en daktegels beklede toren (gerenoveerd circa 1980). In opdracht van bouwondernemer K. Hille had De Klerk al het Eerste Blok (Spaarndammerplantsoen 68-138; 1913-''15) getekend, wel gesloten maar nog iets rustiger van karakter. Aan de zuidzijde van het plantsoen verrees in 1915-''16 voor &lsquo;Eigen Haard&rsquo; het Tweede Blok (Spaarndammerplantsoen 33-103) met opmerkelijk plastische ingangspartijen. Een bijzondere stedenbouwkundige samenhang heeft het in Plan-Zuid voor de &lsquo;De Dageraad&rsquo; in 1919-''21 gebouwde complex met de P.L. Takstraat als centraal element en aan weerszijden woonblokken aan het Th. Schwartzeplein en het H. Ronnerplein (gerenoveerd 1983). Het ontwerp van M. de Klerk en P.L. Kramer voor dit project heeft als meest opvallende plastische elementen de blokvormig gelede wanden aan de beide pleinen - met schoorstenen en laddervensters als accenten - en de hoekoplossingen met naar boven toe terugwijkende golvende gevelvlakken op de hoeken van de P.L. Takstraat en de Burg. Tellegenstraat. Het beeldhouwwerk is van H. Krop. Aan de noordzijde wordt het complex afgesloten door het Co&ouml;peratiehof (1925-''28, P.L. Kramer), gebouwd voor &lsquo;Onze Woning&rsquo;. Diverse andere volkswoningbouwprojecten kwamen tot stand naar expressionistische ontwerpen van J.C. van Epen; alle met kenmerkende erkervormige geledingen in de gevel. Zo ontwierp hij voor &lsquo;Rochdale&rsquo; het complex C. Krusemanstraat e.o. (1916-''26), voor de &lsquo;Algemene Woningbouw Vereniging&rsquo; de blokken Willaertstraat 1-17 (1916-''22) en Smaragdstraat e.o. (1922-''24), en voor de &lsquo;Amsterdamse Co&ouml;peratieve Woningbouwvereniging Samenwerking&rsquo; de Harmoniehof e.o. (1919-''22; in 1920-''23 aangevuld met enkele dubbele villa''s). Voor de laatstgenoemde woningbouwvereniging tekende Amsterdam, Tweede Blok Spaarndammerplantsoen J.F. Staal in plastische expressionistische stijl het blok J.M. Coenenstraat e.o. (1922-''24). Veel traditioneler van vorm zijn ten slotte de huizen Kraaipanstraat e.o. (1920-''24, J. Gratama en G. Versteeg) met hun kenmerkende &lsquo;open&rsquo; hoekoplossingen met trapgevels.', 52.3896, 4.87622, 'Amsterdam', 'Noord-Holland', 'Spaarndammerplantsoen', '17-204', '1914', 1914, NULL, '{"blokken": 1, "kraaipanstraat": 1, "plantsoen": 1, "volkshuisvesting": 1, "opvallende": 1, "traditioneler": 1, "rustiger": 1, "amsterdam": 3, "tekende": 1, "spaarndammerplantsoen": 5, "bedsteden": 1, "oosten&rsquo": 1, "open&rsquo": 1, "periode": 1, "huizen": 1, "socialistisch": 1, "ingangspartijen": 1, "ronnerplein": 1, "schaepman&rsquo": 1, "enkele": 1, "willaertstraat": 1, "grond": 1, "gebouwd": 1, "klerk": 3, "ontworpen": 1, "gratama": 1, "stijl": 2, "keppler": 2, "rationalistische": 1, "woningen": 1, "gepleisterde": 1, "-": 2, "33-103": 1, "e.o": 7, "andere": 2, "project": 1, "1983": 1, "1913-''15": 1, "1980": 1, "1-134": 1, "veel": 1, "kramer": 2, "peratieve": 2, "krijgen": 1, "trapgevels": 1, "centraal": 1, "plan-zuid": 1, "noordzijde": 1, "bij": 1, "liet": 1, "plastische": 4, "complex": 4, "gebouwde": 1, "&lsquo": 18, "68-138": 1, "tonvormige": 1, "terugwijkende": 1, "de": 42, "vereniging": 1, "vereniging&rsquo": 1, "terugspringen": 1, "directeur": 1, "dr": 1, "wel": 2, "g": 1, "c": 1, "woonblokken": 1, "opdracht": 1, "woningblokken": 1, "walenkamp": 1, "a": 1, "expressionistische": 3, "n": 1, "m": 2, "j": 1, "slotte": 1, "k": 1, "h": 2, "1907-''08": 1, "onze": 1, "voortdurende": 1, "weer": 1, "k.p.c": 1, "heeft": 3, "westen&rsquo": 1, "stijgende": 1, "en": 16, "vorm": 2, "er": 1, "versteeg": 1, "volkswoningbouwprojecten": 1, "aangevuld": 1, "samen": 2, "rijkste": 1, "1-17": 1, "tweede": 2, "woningbouwverenigingen": 1