INSERT INTO `Monument` VALUES(6107, 11, 'Ons'' Lieve Heer op Solder', 'De voorm. R.K. schuilkerk Ons'' Lieve Heer op Solder (OZ Voorburgwal 40) , gewijd aan St. Nicolaas, is een van de weinige nog resterende katholieke huiskerken in Amsterdam. Een in oorsprong 16de-eeuws pand ter plaatse werd in 1655 gekocht door metselaar Willem Jacobsz van der Gaffel en timmerman-houtkoper Gijsbert Cruijf en vervolgens vermoedelijk geheel vernieuwd tot een voorhuis met twee achterhuizen. Jan Hartman kocht dit pand in 1661 en liet het in 1661-''63 verbouwen tot een winkel met kantoor. In het achtergedeelte werd een representatieve zaal in classicistische stijl ingericht met een marmeren schouw en een beschilderd cassetteplafond. Op de tweede en derde verdieping liet hij de kerkzaal met omlopende dubbele galerij inrichten. In 1737 werden de zaal en de kerkruimte ingrijpend verbouwd door priester Ludovicus Reiniers. Begin 19de eeuw heeft men de halsgevel aan de voorzijde veranderd in een puntgevel. De parochie is in 1887 verhuisd naar de St.-Nicolaaskerk en sinds 1888 bevat het pand het Museum Amstelkring (gerestaureerd 1919, 1939 en 1965). Tot de oude kerkinventaris behoren een barok hoofdaltaar, een preekstoel (eerste helft 18de eeuw), vier altaarstukken (1670-1750) en een door Hendrik Meijer gebouwd orgel (1794).', 52.3751, 4.89935, 'Amsterdam', 'Noord-Holland', 'Oudezijds Voorburgwal', '40', NULL, NULL, 'Museum Ons'' Lieve Heer op Solder', '{"amstelkring": 1, "omlopende": 1, "ons''": 2, "altaarstukken": 1, "geheel": 1, "marmeren": 1, "door": 3, "amsterdam": 2, "werden": 1, "oorsprong": 1, "weinige": 1, "19de": 1, "40": 1, "solder": 2, "kocht": 1, "het": 4, "winkel": 1, "gebouwd": 1, "achterhuizen": 1, "zaal": 2, "voorburgwal": 1, "op": 3, "nog": 1, "stijl": 1, "verhuisd": 1, "ingrijpend": 1, "heer": 2, "cassetteplafond": 1, "museum": 1, "16de-eeuws": 1, "lieve": 2, "aan": 2, "oz": 1, "1794": 1, "kerkruimte": 1, "helft": 1, "voorzijde": 1, "reiniers": 1, "metselaar": 1, "vier": 1,