INSERT INTO `Monument` VALUES(8165, 15, 'Paleis Het Loo', 'Het Honinklijk paleis Het Loo of het Nieuwe Loo (Koninklijk Park 1) werd in 1685-''86 in opdracht van stadhouder Willem III gebouwd in classicistische vormen naar plannen van Jacob Roman. In die tijd kwam het centrale, vierkante corps de logis tot stand, waarvan het middenrisaliet is voorzien van een fronton en een klok (Gerhard Schimmel, 1686). Aan weerszijden van de voorhof verrezen langgerekte zijvleugels, die oorspronkelijk met kwartronde colonnades waren verbonden met het corps de logis. Haaks op de zijvleugels werden dienstvleugels met hoekpaviljoens gebouwd. Nadat Willem III in 1689 ook koning van Engeland was geworden, liet hij in 1691-''94 vier nieuwe paviljoens optrekken tussen het corps de logis en de zijvleugels. Daarin werden onder meer een nieuwe eetzaal, een schilderijengalerij en een kapel ondergebracht. De colonnades werden verplaatst om te dienen als afsluiting van de boventuin. Toen het paleis in 1807-''09 als zomerverblijf werd ingericht voor Lodewijk Napoleon heeft men het geheel gepleisterd. Koning Willem III liet in 1875 aan de oostzijde een aanbouw met kunstzaal optrekken. Bij een verbouwing in 1911-''14, naar plannen van rijksbouwmeester C.H. Peters, verhoogde men het hoofdgebouw en de paviljoens met een lage verdieping. In 1977-''84 werd naar plannen van J.B. baron van Asbeck een ingrijpende reconstructie uitgevoerd van de toestand rond 1700, waarbij het gebouw werd ontpleisterd. Het paleis kreeg een museale functie.', 52.2338, 5.94547, 'Apeldoorn', 'Gelderland', 'Koninklijk Park', '1', '1685-''86', 1686, 'Paleis Het Loo', '{"stadhouder": 1, "geheel": 1, "iii": 3, "werden": 3, "klok": 1, "of": 1, "gepleisterd": 1, "weerszijden": 1, "het": 13, "om": 1, "nadat": 1, "middenrisaliet": 1, "gebouwd": 2, "verbouwing": 1, "op": 1, "loo": 3, "ook": 1, "ontpleisterd": 1, "peters": 1, "waarbij": 1, "aan": 2, "verrezen": 1, "meer": 1, "1": 1, "gerhard": 1, "waarvan": 1, "voorhof": 1, "lage": 1,