INSERT INTO `Monument` VALUES(8247, 16, 'NicolaÃ¯kerk', 'De Herv. kerk (Wijkstraat 32) , oorspronkelijk gewijd aan St.-Nicolaas, is een driebeukige hallenkerk met vijfzijdig gesloten koor en vrijstaande toren. In het begin van de 13de eeuw werd een eenbeukige kerk met westtoren gebouwd ter plaatse van een aan Maria gewijde voorganger. Kort na het midden van die eeuw volgden de bouw van een dwarsschip en een recht gesloten koor, waardoor een romano-gotische kruiskerk ontstond. De topgevels zijn in de 17de eeuw verdwenen. In het begin van de 14de eeuw verlengde men het koor met een vijfzijdig gesloten, gotisch deel. In het derde kwart van de 15de eeuw kwam de huidige hallenkerk tot stand door de bouw van een noord- en een zuidbeuk. Kort daarna werd bij het koor de zuidkapel (Jozefkapel) gebouwd. De noordkapel (Mariakapel), met de aangebouwde  Appingedam, Herv. kerk en stadhuis, plattegrond sacristie en op de verdieping mogelijk een librije, kwam in het begin van de 16de eeuw tot stand. Rond dezelfde tijd sloopte men de oude westtoren. De kerk werd volgens een gevelsteen in 1561 hersteld, in 1594 van binnen wit gekalkt en in 1686 opnieuw hersteld na stormschade. Bij een restauratie in 1948-''54 naar plannen van A.R. Wittop Koning, R. Offringa en G. Bosma is onder meer de kapconstructie vernieuwd.', 53.3199, 6.85766, 'Appingedam', 'Groningen', 'Wijkstraat', '32', 'begin 13e eeuw', 1300, 'NicolaÃ¯kerk (Appingedam)', '{"kruiskerk": 1, "door": 1, "aangebouwde": 1, "gewijde": 1, "zuidbeuk": 1, "17de": 1, "romano-gotische": 1, "het": 7, "deel": 1, "verlengde": 1, "gebouwd": 2, "op": 1, "topgevels": 1, "sloopte": 1, "aan": 2, "maria": 1, "meer": 1, "1594": 1, "32": 1, "jozefkapel": 1, "noordkapel": 1, "kapconstructie": 1, "kort": 2, "bij": 2, "13de": 1, "bosma": 1, "naar": 1, "stormschade": 1, "huidige": 1, "verdieping": 1, "eeuw": 6, "de": 17, "gekalkt": 1, "vijfzijdig": 2, "g": 1, "volgden": 1, "15de": 1, "daarna": 1, "oude": 1, "binnen": 1, "waardoor": 1, "hersteld": 2, "n