INSERT INTO `Monument` VALUES(8564, 79, 'Paleis Soestdijk', 'Paleis Soestdijk (Amsterdamsestraatweg 1), een breed, wit gepleisterd gebouw met gebogen vleugels, diende verschillende stadhouders, prinsen en vorsten van het huis van Oranje tot (zomer)residentie. Omstreeks 1650 liet de Amsterdammer Cornelis de Graeff een huis met hofstede bouwen. Na diens dood kocht stadhouder Willem III het landhuis, waarna hij het in de jaren 1674-''78 liet verbouwen tot jachtslot. Het ontwerp werd geleverd door stadhouderlijk architect Maurits Post. Het oude gebouw werd aan de achterzijde met een grote zaal en aan weerszijden met een vleugel vergroot. In de Franse tijd werd het door Lodewijk Napoleon geconfisceerd. Hij gaf J.Th. Thibault opdracht tot uitbreiding. In 1815 schonk de Staat het pand aan kroonprins Willem, de latere koning Willem II, wegens zijn verdiensten tijdens de slag bij Quatre Bras. In de periode 1816 tot 1822 werd het paleis op ''s lands kosten verbouwd en vergroot in neoclassicistische stijl, naar ontwerp van Jan de Greef en Zeger Reijers. Het bestaande gebouw werd wit gepleisterd en voorzien van een rond bordes en een hardstenen ingangspartij met balkon. Ook de vensters werden gemoderniseerd. De in het midden naar binnen buigende attiek, die oorspronkelijk alleen het middendeel bekroonde, werd nu over het gehele gebouw doorgetrokken. Op het dak werd met gebruikmaking van de oude schoorstenen een rechthoekig belv&eacute;d&egrave;re geconstrueerd. Aan weerszijden ontstonden nieuwe vertrekken met daarop aansluitend kwart-ronde vleugels tussen paviljoens. De vleugels met dorische zuilen waren oorspronkelijk open maar zijn later met glas gesloten. Inwendig verbouwde men onder meer de grote zaal tot een lagere zaal in empire-stijl met rijk gestucte lijsten en cassettentongewelf. Twee kamers in het oude gedeelte rechts van de hoofdingang werden samengetrokken en in 1819 door J.W. Pieneman voorzien van een schildering voorstellende &lsquo;De prins van Oranje bij Quatre Bras 16 juni 1815&rsquo;. In 1937 is het paleis onder leiding van J. de Bie Leuveling Tjeenk en A.J. van der Steur inwendig gemoderniseerd.', 52.1961, 5.27702, 'Soestdijk', 'Utrecht', 'Amsterdamsestraatweg', '1', '1650', 1650, 'Paleis Soestdijk', '{"nu": 1, "daarop": 1, "geconfisceerd": 1, "slag": 1, "stadhouder": 1, "dood": 1, "leiding": 1, "door": 3, "werden": 2, "iii": 1, "cassettentongewelf": 1, "buigende": 1, "hardstenen": 1, "uitbreiding": 1, "oranje": 2, "soestdijk": 3, "maurits": 1, "open": 1, "over": 1, "gepleisterd": 2, "kosten": 1, "1822": 1, "periode": 1, "weerszijden": 2, "kocht": 1, "het": 15, "middendeel": 1, "zomer": 1, "waarna": 1, "bordes": 1, "voorstellende": 1, "schoorstenen": 1, "zaal": 3, "gaf": 1, "op": 2, "ook": 1, "stijl": 1, "alleen": 1, "aan": 4, "doorgetrokken": 1, "meer": 1, "latere": 1, "j.th": 1, "1": 1, "geconstrueerd": 1, "stadhouders": 1, "vorsten": 1, "1815": 1, "1816": 1, "vertrekken": 1, "1819": 1, "glas": 1, "bij": 2, "kroonprins": 1, "lands": 1, "der": 1, "jaren": 1, "liet": 2, "verbouwen": 1, "gehele": 1, "aansluitend": 1, "naar": 2, "voorzien": 2, "&lsquo": 1, "16": 1, "attiek": 1, "hoofdingang": 1, "reijers": 1, "tijdens": 1, "de": 18, "twee": 1, "ingangspartij": 1, "willem": 3, "gestucte": 1, "bekroonde": 1, "amsterdamsestraatweg": 1, "post": 1, "napoleon": 1, "later": 1, "opdracht": 1, "verbouwde": 1, "dorische": 1, "huis": 2, "lijsten": 1, "oude": 3, "lodewijk": 1, "staat": 1, "j": 1, "binnen": 1, "franse": 1, "na": 1, "wegens": 1, "''s": 1, "oorspronkelijk": 2, "kamers": 1, "en": 9, "vensters": 1, "breed": 1, "greef": 1, "graeff": 1, "maar": 1, "bestaande": 1, "1937": 1, "gesloten": 1, "gebouw": 4, "vergroot": 2, "verdiensten": 1, "koning": 1, "kwart-ronde": 1, "verbouwd": 1, "hij": 2, "bras": 2, "nieuwe": 1, "jachtslot": 1, "diende": 1, "d&egrave": 1, "ontwerp": 2, "werd": 7, "pieneman": 1, "rijk": 1, "lagere": 1, "waren": 1, "gedeelte": 1, "jan": 1, "bouwen": 1, "residentie": 1, "samengetrokken": 1, "thibault": 1, "een