INSERT INTO `Monument` VALUES(8826, 70, 'Boerderij De Eenhoorn', 'Boerderijen. De boerderijen in de Beemster, in de regel stolpboerderijen, zijn veelal gebouwd in baksteen of baksteen en hout. Enkele boerderijen zijn geheel in hout opgetrokken. Het rijkste voorbeeld is boerderij De Eenhoorn (Middenweg 196), waarvan het deels onderkelderde bakstenen woongedeelte een hoger opgetrokken middenpartij met classicistische halsgevel heeft. Deze wordt bekroond door een segmentvormig fronton met daarop het beeld van een eenhoorn; een cartouche vermeldt als bouwjaar 1682. In de melkkelder bevindt zich een betegelde schouw. Bij de boerderij Lepelaar (Middenweg 194) heeft de middenpartij van het bakstenen woongedeelte een schoudergevel met vazen en bekronend fronton. Gevelstenen tonen een lepelaar en het jaartal 1683. De opkamer bevat een betegelde wand en op het houtwerk geschilderde voorstellingen van engeltjes en ploegende boeren. In oorsprong 17de-eeuws is ook de boerderij Tijdverdrijf (Middenweg 50) bij Noordbeemster met darsdeuren aan de voorzijde. De in de 19de eeuw gepleisterde gevel is in de top gedateerd 1667.', 52.5333, 4.90299, 'Middenbeemster', 'Noord-Holland', 'Middenweg', '196', '1682 (cartouche)', 1682, 'De Eenhoorn (boerderij)', '{"daarop": 1, "opgetrokken": 2, "rijkste": 1, "geheel": 1, "vazen": 1, "194": 1, "door": 1, "196": 1, "oorsprong": 1, "middenbeemster": 1, "deels": 1, "hoger": 1, "of": 1, "19de": 1, "noordbeemster": 1, "betegelde": 2, "1667": 1, "het": 6, "beemster": 1, "engeltjes": 1, "bevindt": 1, "boerderij": 4, "enkele": 1, "tonen": 1, "gebouwd": 1, "deze": 1, "segmentvormig": 1, "ploegende": 1, "op": 1, "boerderijen": 3, "een": 8, "ook": 1, "aan": 1, "gepleisterde": 1, "middenpartij": 2, "eenhoorn": 3, "beeld": 1, "bekroond": 1, "voorzijde": 1, "baksteen": 2, "waarvan": 1, "geschilderde": 1, "bij": 2, "onderkelderde": 1, "17de-eeuws": 1, "van": 3, "cartouche": 1, "vermeldt": 1, "schouw": 1, "veelal": 1, "schoudergevel": 1, "voorstellingen": 1, "ja