INSERT INTO `Monument` VALUES(9244, 18, 'Markiezenhof', 'Het Markiezenhof (Steenbergsestraat 6-8) is een van de belangrijkste voorbeelden van laat-middeleeuwse stedelijke wooncultuur in Nederland. De basis voor dit stadspaleis zal in het midden van de 14de eeuw zijn gelegd. Het eerste complex bestond uit een zaalgebouw met dwarsvleugel, traptoren en keuken ten noorden van de Grebbe. Door de aankoop van een perceel ten zuiden van die waterloop werd verdere uitbreiding van het complex in de eerste helft van de 15de eeuw mogelijk, waarbij de Grebbe werd overkluisd.', 51.4958, 4.28471, 'Bergen op Zoom', 'Noord-Brabant', 'Steenbergsestraat', '6-8', NULL, NULL, 'Markiezenhof', '{"ten": 2, "dwarsvleugel": 1, "basis": 1, "zoom": 1, "door": 1, "uitbreiding": 1, "werd": 2, "bestond": 1, "het": 4, "zaalgebouw": 1, "perceel": 1, "voor": 1, "op": 1, "een": 3, "waarbij": 1, "gelegd": 1, "helft": 1, "uit": 1, "keuken": 1, "noorden": 1, "voorbeelden": 1, "wooncultuur": 1, "van": 8, "complex": 2, "midden": 1, "6-8": 1, "zijn": 1, "eeuw": 2, "de": 8, "met": 1, "aankoop": 1, "overkluisd": 1, "dit": 1, "die": 1, "bergen": 1, "is": 1, "nederland": 1, "belangrijkste": 1, "eerste": 2, "laat-middeleeuwse": 1, "markiezenhof": 2, "15de": 1, "waterloop": 1, "in": 3, "stadspaleis": 1, "verdere": 1, "14de": 1, "stedelijke": 1, "mogelijk": 1, "zal": 1, "steenbergsestraat": 1, "en": 1, "traptoren": 1, "grebbe": 2, "zuiden": 1}');
