INSERT INTO `Monument` VALUES(13417, 27, 'Grote Kerk', 'De (Herv.) Grote of O.L.-Vrouwekerk (Grotekerksplein 8) is een forse driebeukige basilicale kruiskerk met kapellen langs schip en koor (zuidzijde), een kooromgang met vijf straalkapellen, een Mariakoor (noordzijde) en een westtoren. Van de koorsluiting van een tufstenen voorganger zijn restanten 12de-eeuws muurwerk aangetroffen in het huidige koor. Bij deze eerste parochiekerk werd een Mariakoor (gewijd 1285) opgetrokken, mogelijk kleiner van omvang dan het huidige. Vanaf de 14de eeuw werd de kerk in fasen herbouwd en uitgebreid. Na de verheffing tot kapittelkerk in 1366 begon men met de bouw van een groter koor en de vernieuwing van het Mariakoor, dat siermotieven in gesinterde baksteen kreeg. Begin 15de werd er gewerkt aan transept en schip.', 51.8142, 4.66062, 'Dordrecht', 'Zuid-Holland', 'Grotekerksplein', '8', 'middeleeuwen', NULL, 'Grote of Onze-Lieve-Vrouwekerk (Dordrecht)', '{"opgetrokken": 1, "muurwerk": 1, "kleiner": 1, "kruiskerk": 1, "parochiekerk": 1, "kerk": 2, "vanaf": 1, "of": 1, "werd": 3, "dordrecht": 1, "westtoren": 1, "langs": 1, "het": 3, "herv": 1, "deze": 1, "straalkapellen": 1, "een": 7, "forse": 1, "kreeg": 1, "o.l.-vrouwekerk": 1, "koorsluiting": 1, "fasen": 1, "1285": 1, "gesinterde": 1, "bouw": 1, "vijf": 1, "vernieuwing": 1, "aan": 1, "gewerkt": 1, "driebeukige": 1, "dat": 1, "grotekerksplein": 1, "baksteen": 1, "dan": 1, "begon": 1, "groter": 1, "8": 1, "herbouwd": 1, "noordzijde": 1, "bij": 1, "aangetroffen": 1, "mariakoor": 3, "van": 5, "schip": 2, "huidige": 2, "basilicale": 1, "siermotieven": 1, "zijn": 1, "12de-eeuws": 1, "eeuw": 1, "de": 7, "met": 3, "tot": 1, "voorganger": 1, "grote": 2, "koor": 3, "uitgebreid": 1, "1366": 1, "kapellen": 1, "men": 1, "zuidzijde": 1, "restanten": 1, "is": 1, "eerste": 1, "gewijd": 1, "15de": 1, "kooromgang": 1, "transept": 1, "in": 4, "begin": 1, "kapittelkerk": 1, "na": 1, "verheffing": 1, "14de": 1, "mogelijk": 1, "omvang": 1, "en": 5, "tuf