INSERT INTO `Monument` VALUES(14985, 29, 'Stadhuis', 'Het stadhuis (Breedstraat 53) is een imposant tweelaags gebouw met mezzanino, bekronend attiekstuk en een omlopend schilddak met hoekschoorstenen en een achtzijdige houten koepeltoren. De voorgevel met balkon en hoekrisalieten is in Bentheimer zandsteen uitgevoerd. Dit in de strakke stijl van het classicisme uitgevoerde stadhuis kwam in 1686-''94 tot stand naar plannen van Steven Vennecool ter vervanging van een voorganger uit 1460. De beelden op de attiek (Wijs Beleid en Eendrachtig Bestuur) en de stedenmaagden aan weerszijden van het balkon zijn gemaakt door Pieter van der Plasse. Een cartouche boven het balkon meldt het devies van Enkhuizen: &lsquo;Candide et Constanter&rsquo; (oprecht en standvastig). Het v&oacute;&oacute;r de voorgevel opgestelde kanon (1551) werd in 1622 buitgemaakt op Duinkerker kapers; het verhaal daarvan staat op een gevelbord met gesneden omlijsting (1661; gedicht Joost van den Vondel). Binnen leidt de lage Blauwe Zaal (hardstenen vloer) via een trap naar de ruime en hoge Witte Zaal of Burgerzaal (met marmeren vloer), die in spaarvelden is voorzien van grisailles (Dirck Ferreris). Verder heeft deze ruimte zes armvormige houten luchters. De toegang tot de Burgemeesterskamer is een houten dorisch poortje met bovendeurstuk &lsquo;Triomf van de Vrede&rsquo; (Ferreris). Een geschilderd behangsel toont een allegorie op het Romeinse bestuur (1707, gerestaureerd 1903), ontworpen door Romeyn de Hooghe en uitgevoerd door diens leerlingen. Verder zijn hier een plafondschildering voorstellend &lsquo;Kracht en Liefde&rsquo; (Ferreris) en een schouw met een kort na 1801 aangebracht 17de-eeuws schoorsteenstuk met als thema Charitas (Theodoor van Tulden). De Vroedschapskamer heeft een wandbekleding van rode velours d''Utrecht. De drie plafondschilderingen (paalkistrecht, Gerechtigheid en visvangst) zijn evenals het schoorsteenstuk (Wijsheid) gemaakt door Ferreris. Ook de Schepenkamer (nu trouwzaal) heeft een (groene) velours d''Utrecht-bekleding (gerestaureerd 1902). Wederom van Ferreris zijn de plafondschildering (Rede en Waarheid) en het schoorsteenstuk (Justitia). De Weeskamer bevat een marmeren schoorsteenmantel in Lodewijk XV-vormen (Asmus Frauen), een schoorsteenstuk uit 1692 (Barmhartigheid; Johan van Neck) en wandtapijten met arcadische landschappen en allegorische verwijzingen naar de verzorging van wezen (1710, Alexander Baert). Twee andere vertrekken hebben elk nog een schoorsteenstuk van Johan van Neck. De voorm. stadsgevangenis (Zwaanstraat ong.) , gelegen op korte afstand achter het stadhuis, is een rijzig diep pand met drie bouwlagen en per laag twee ruime houten cellen. De onderste cellen dateren uit 1592. Een ophoging volgde in 1610 en er zijn verbouwingen uitgevoerd 1908, 1955 en 1988-''91.', 52.7041, 5.29479, 'Enkhuizen', 'Noord-Holland', 'Breedstraat', '53', '1688', 1688, 'Stadhuis van Enkhuizen', '{"kapers": 1, "v&oacute": 1, "devies": 1, "marmeren": 2, "1988-''91": 1, "ruime": 2, "plafondschilderingen": 1, "hardstenen": 1, "velours": 2, "stadsgevangenis": 1, "frauen": 1, "aangebracht": 1, "romeyn": 1, "arcadische": 1, "opgestelde": 1, "eendrachtig": 1, "ferreris": 5, "liefde&rsquo": 1, "ontworpen": 1, "stijl": 1, "classicisme": 1, "andere": 1, "koepeltoren": 1, "1592": 1, "vondel": 1, "1710": 1, "hier": 1, "kort": 1, "tweelaags": 1, "vertrekken": 1, "lage": 1, "achter": 1, "blauwe": 1, "weeskamer": 1, "voorzien": 1, "luchters": 1, "&lsquo": 3, "leidt": 1, "verbouwingen": 1, "verzorging": 1, "attiek": 1, "drie": 2, "de": 20, "twee": 2, "stedenmaagden": 1, "1707": 1, "bevat": 1, "1460": 1, "bentheimer": 1, "hebben": 1, "pieter": 1, "&oacute": 1, "allegorische": 1, "duinkerker": 1, "toont": 1, "alexander": 1, "kanon": 1, "lodewijk": 1, "heeft": 3, "schoorsteenmantel": 1, "cellen": 2, "zes": 1, "r": 1, "en": 18, "et": 1, "er": 1, "witte": 1, "gebouw": 1, "dateren": 1, "vennecool": 1, "bouwlagen": 1, "daarvan": 1, "bestuur": 2, "rijzig": 1, "burg