INSERT INTO `Monument` VALUES(15211, 28, 'Nederlands Hervormde Gomarus- of Westerkerk', 'De (Herv.) St.-Gomarus- of Westerkerk (Westerstraat 138) is een op een omheind kerkhof gelegen driebeukige hallenkerk. De drie beuken hebben samen &eacute;&eacute;n enkele driezijdige sluiting met op de knikken kleine traptorens. De bouw van de laat-gotische zuidbeuk begon in 1470, waarna de twee andere beuken volgden in 1471 en 1480. In het oostelijke deel rusten de scheibogen op zuilen van afwisselend Bentheimersteen en Ledesteen. De in een topgevel gevatte oostelijke eindvensters van de zijbeuken steken door de daklijst heen. In 1488-''92 kwam een - uitwendig niet als zodanig herkenbaar - dwarsschip tot stand met zuilen van Ledesteen. In een derde fase verrezen in 1512-''19 de vier westelijke schiptravee&euml;n met zuilen van Bentheimer steen. De zijbeuken kregen bij de westgevel geveltoppen met een hoog middenvenster geflankeerd door gotische blindnissen. De doopkapel bij de zuidwesthoek is korte tijd later toegevoegd.', 52.7034, 5.2871, 'Enkhuizen', 'Noord-Holland', 'Westerstraat', '138', NULL, NULL, 'Westerkerk (Enkhuizen)', '{"uitwendig": 1, "doopkapel": 1, "door": 2, "nederlands": 1, "zuidbeuk": 1, "laat-gotische": 1, "of": 2, "westerkerk": 2, "het": 1, "deel": 1, "1480": 1, "waarna": 1, "enkele": 1, "knikken": 1, "op": 3, "heen": 1, "&eacute": 2, "verrezen": 1, "-": 2, "andere": 1, "afwisselend": 1, "kerkhof": 1, "begon": 1, "gotische": 1, "hervormde": 1, "omheind": 1, "vier": 1, "bij": 2, "drie": 1, "de": 15, "twee": 1, "beuken": 2, "zuidwesthoek": 1, "zijbeuken": 2, "bentheimer": 1, "hebben": 1, "korte": 1, "later": 1, "n": 2, "volgden": 1, "westgevel": 1, "bentheimersteen": 1, "scheibogen": 1, "en": 2, "1470": 1, "1471": 1, "zodanig": 1, "enkhuizen": 1, "1488-''92": 1, "samen": 1, "hallenkerk": 1, "geflankeerd": 1, "blindnissen": 1, "gelegen": 1, "kleine": 1, "steken": 1, "toegevoegd": 1, "herv": 1, "hoog": 1, "derde": 1, "een": 6, "gomarus-": 1, "bouw": 1, "sluiting": 1, "fase": 1, "driebeukige": 1, "zuilen": 3, "herkenbaar": 1, "middenvenster": 1, "tijd": 1, "kwam": 1, "1512-''19": 1, "van": 5, "138": 1, "geveltoppen": 1, "daklijst": 1, "dwarsschip": 1, "westelijke": 1, "ledesteen": 2, "met": 4, "tot": 1, "westerstraat": 1, "topgevel": 1, "als": 1, "eindvensters": 1, "is": 2, "st.-gomarus-": 1, "oostelijke": 2, "gevatte": 1, "steen": 1, "in": 7, "niet": 1, "stand": 1, "rusten": 1, "traptorens": 1, "kregen": 1, "driezijdige": 1, "schiptravee&euml": 1}');
INSERT INTO `Monument` VALUES(15669, 30, 'Planetarium Eise Eisinga, planetarium', 'Het planetarium (Eise Eisingastraat 3) is gehuisvest in een eenlaagspand met klokgevel uit 1768. In 1774-''81 bracht de sterrenkundige Eise Eisinga hier in de woonkamer een schaalmodel van het zonnestelsel aan tegen een blauw geschilderd houten plafond. De mechanische aandrijving van het model bevindt zich op zolder. Het huis is nu een museum.', 53.1875, 5.54379, 'Franeker', 'Friesland', 'Eise Eisingastraat', '3', '1774-1781', 1781, 'Planetarium Eise Eisinga', '{"nu": 1, "houten": 1, "model": 1, "van": 2, "sterrenkundige": 1, "zonnestelsel": 1, "eisingastraat": 1, "gehuisvest": 1, "1768": 1, "klokgevel": 1, "de": 3, "met": 1, "zich": 1, "eisinga": 2, "woonkamer": 1, "plafond": 1, "het": 4, "planetarium": 3, "franeker": 1, "1774-''81": 1, "bevindt": 1, "bracht": 1, "is": 2, "eenlaagspand": 1, "op": 1, "een": 4, "schaalmodel": 1, "huis": 1, "museum": 1, "aan": 1, "in": 3, "3": 1, "aandrijving": 1, "uit": 1, "eise": 3, "hier": 1, "mechanische": 1, "zolder": 1, "tegen": 1, "blauw": 1, "geschilderd": 1}');
