INSERT INTO `Monument` VALUES(17650, 45, 'Mauritshuis', 'Het Mauritshuis (Korte Vijverberg 8) kwam tussen 1633 en 1644 tot stand voor Johan Maurits van Nassau-Siegen, die in 1636-''44 gouverneur was in Brazili&euml; voor de West-Indische Compagnie. Het door natuurstenen kolossale ionische pilasters gelede blokvormige gebouw is een vroeg ontwerp in classicistische stijl van Jacob van Campen. Bij de uitwerking assisteerde Pieter Post. De timpanen van frontons bij de geheel met natuursteen beklede middentravee&euml;n aan voor- en achterzijde tonen respectievelijk het wapen van de bouwheer en een door beeldhouwer Pieter Adriaensz ''t Hooft in reli&euml;f vervaardigd strijdtafereel. Het gebouw brandde in 1704 geheel uit. Bij het herstel in 1708-''16, onder leiding van Gijsbert Blotelingh (tot zijn dood in 1713), werden de kruisvensters verwijderd en de borstweringen bij de vensters van de bel-etage verlaagd.', 52.0804, 4.3143, '''s-Gravenhage', 'Zuid-Holland', 'Korte Vijverberg', '8', '1636', 1636, 'Mauritshuis', '{"geheel": 2, "natuurstenen": 1, "dood": 1, "gebouw": 2, "verwijderd": 1, "leiding": 1, "door": 2, "werden": 1, "reli&euml": 1, "voor-": 1, "maurits": 1, "frontons": 1, "1636-''44": 1, "ontwerp": 1, "het": 5, "voor": 2, "uitwerking": 1, "herstel": 1, "brazili&euml": 1, "tonen": 1, "kolossale": 1, "een": 2, "vroeg": 1, "stijl": 1, "middentravee&euml": 1, "vervaardigd": 1, "brandde": 1, "wapen": 1, "jacob": 1, "aan": 1, "blotelingh": 1, "bouwheer": 1, "kruisvensters": 1, "gouverneur": 1, "uit": 1, "1713": 1, "johan": 1, "assisteerde": 1, "8": 1, "respectievelijk": 1, "kwam": 1, "bij": 4, "vijverberg": 1, "van": 7, "gelede": 1, "natuursteen": 1, "bel-etage": 1, "zijn": 1, "compagnie": 1, "adriaensz": 1, "was": 1, "1704": 1, "de": 9, "met": 1, "mauritshuis": 2, "tussen": 1, "verlaagd": 1, "tot": 2, "pilasters": 1, "die": 1, "1644": 1, "gijsbert": 1, "strijdtafereel": 1, "timpanen": 1, "beklede": 1, "pieter": 2, "borstweringen": 1, "beeldhouwer": 1, "f": 1, "korte":