INSERT INTO `Monument` VALUES(17998, 40, 'Nieuwe Kerk', 'De voorm. (Herv.) Nieuwe Kerk (Spui 175) is een compact gebouw met driezijdig gesloten korte zijden en twee driezijdig gesloten apsiden bij de lange zijden. Deze fraaie classicistische kerk met opengewerkte daktoren, zandstenen hoekpilasters en grote vazen met draperie&euml;n op de hoeken kwam in 1649-''56 tot stand naar plannen van Pieter Arentsz Noorwits en Bartholomeus van Bassen. Het ingangsportaal aan de oostzijde is voorzien van wapens en het jaartal 1658. In de daktoren hangen twee door Coenraet Anthonisz gegoten klokken (1656). De kerk is hersteld in 1881-''85 en 1950-''53 (daktoren). Bij een ingrijpende restauratie in 1970-''77, onder leiding van Ph.J.W.C. Bolt en E.A. Canneman, heeft men de kerk ten behoeve van het gebruik voor algemene culturele doeleinden onderkelderd met een nieuwe foyer. De aanbouwen in het midden van de lange zijden, oorspronkelijk dienend als consistorie en hofloge, zijn in de loop van de tijd naar buiten uitgebouwd en weer herbouwd in de oude vorm met hergebruik van frontons en klauwstukken.', 52.0764, 4.31596, '''s-Gravenhage', 'Zuid-Holland', 'Spui', '175', '1649-1656', 1656, 'Nieuwe Kerk (Den Haag)', '{"gegoten": 1, "vazen": 1, "door": 1, "leiding": 1, "klokken": 1, "anthonisz": 1, "behoeve": 1, "e.a": 1, "wapens": 1, "doeleinden": 1, "het": 4, "hergebruik": 1, "draperie&euml": 1, "buiten": 1, "op": 1, "aan": 1, "aanbouwen": 1, "coenraet": 1, "1881-''85": 1, "1970-''77": 1, "bij": 2, "algemene": 1, "naar": 2, "voorzien": 1, "jaartal": 1, "foyer": 1, "oostzijde": 1, "bassen": 1, "1649-''56": 1, "de": 12, "culturele": 1, "twee": 2, "175": 1, "driezijdig": 2, "loop": 1, "opengewerkte": 1, "pieter": 1, "korte": 1, "n": 1, "oude": 1, "hoeken": 1, "weer": 1, "heeft": 1, "hersteld": 1, "zandstenen": 1, "oorspronkelijk": 1, "restauratie": 1, "dienend": 1, "en": 9, "ingangsportaal": 1, "vorm": 1, "apsiden": 1, "ten": 1, "bolt": 1, "consistorie": 1, "gebouw": 1, "gesloten": 2, "kerk"