INSERT INTO `Monument` VALUES(18113, 39, 'Panorama Mesdag', 'Het Panorama Mesdag (Zeestraat 65b-c) werd in 1880-''81 ingericht voor het tonen van een op rondlopend doek geschilderd panorama van het dorp Scheveningen, vervaardigd door H.W. Mesdag in samenwerking met zijn vrouw S. Mesdag-van Houten, G.H. Breitner, Th. de Bock, B.J. Blommers en de Belgische architectuurschilder A. Nijberck. De tentoonstellingsruimte is een veertienzijdige centraalbouw, die men van onderaf bereikt. De ingangspartij aan de Zeestraat werd ontworpen door G. Klomp. De tussenliggende lange gang heeft men in 1910-''11 vervangen door een zalengalerij voor schilderijen van de Haagse School. Voor zijn eigen schilderijencollectie liet Mesdag in 1886-''87 het Museum Mesdag (Laan van Meerdervoort 7) bouwen naar een eclectisch ontwerp van aannemer-architect H. van Jaarsveld (gerestaureerd 1990-''96). Van het naastgelegen - al in 1869-''70 voor hem gebouwde - dubbele herenhuis Laan van Meerdervoort 9-11 bewoonde Mesdag zelf het rechterdeel (verhoogd 1919).', 52.0847, 4.30328, '''s-Gravenhage', 'Zuid-Holland', 'Zeestraat', '65', '1881', 1881, 'Panorama Mesdag', '{"verhoogd": 1, "vrouw": 1, "houten": 1, "naastgelegen": 1, "door": 3, "breitner": 1, "th": 1, "bereikt": 1, "ontwerp": 1, "werd": 2, "1990-''96": 1, "zalengalerij": 1, "architectuurschilder": 1, "eclectisch": 1, "het": 6, "voor": 4, "mesdag-van": 1, "tussenliggende": 1, "rechterdeel": 1, "1869-''70": 1, "bouwen": 1, "hem": 1, "tonen": 1, "g.h": 1, "meerdervoort": 2, "ontworpen": 1, "op": 1, "een": 4, "eigen": 1, "vervaardigd": 1, "vervangen": 1, "nijberck": 1, "museum": 1, "klomp": 1, "aan": 1, "-": 2, "7": 1, "9-11": 1, "h.w": 1, "onderaf": 1, "samenwerking": 1, "geschilderd": 1, "ingericht": 1, "liet": 1, "van": 9, "naar": 1, "gebouwde": 1, "1886-''87": 1, "doek": 1, "blommers": 1, "herenhuis": 1, "zeestraat": 2, "1910-''11": 1, "zijn": 2, "panorama": 3, "de": 7, "met": 1, "bewoonde": 1, "ingangspartij": 1, "rondlopend": 1, "1919": 1, "die"