INSERT INTO `Monument` VALUES(18415, 46, 'Korenbeurs', 'De voorm. Korenbeurs (Akerkhof 1) , gebouwd in 1863-''65 naar ontwerp van stadsbouwmeester J.G. van Beusekom, is in feite de derde korenbeurs ter plaatse. De eerste (houten) beurs verrees in 1774, de tweede in 1826. Het voorgebouw, met zuilenportiek, is uitgevoerd in neoclassicistische stijl. Beelden aan weerszijden van de ingang en op het fronton symboliseren de pijlers van de Groninger welvaart: scheepvaart (Neptunus), landbouw (Ceres) en handel (Mercurius). De zinken beelden zijn vervaardigd door de firma L.J. Enthoven &amp; Co. uit Den Haag. De erachter gelegen, halfrond gesloten beurshal heeft een driebeukige opzet en een bijzondere gietijzeren draagconstructie met veel glas, voor de bij het keuren noodzakelijke lichtinval. Het ijzerwerk werd geleverd door de Groninger IJzer- en Metaalgieterij. Het in 1990-''91 naar plannen van architectenbureau C. Kalfsbeek gerenoveerde beursgebouw heeft tegenwoordig voornamelijk een horeca-functie.', 53.2168, 6.56359, 'Groningen', 'Groningen', 'Akerkhof', '1', '1862-''65', 1865, 'Korenbeurs (Groningen)', '{"houten": 1, "door": 2, "mercurius": 1, "1990-''91": 1, "weerszijden": 1, "het": 5, "1826": 1, "horeca-functie": 1, "gebouwd": 1, "zinken": 1, "op": 1, "stijl": 1, "vervaardigd": 1, "neptunus": 1, "aan": 1, "opzet": 1, "1": 1, "scheepvaart": 1, "veel": 1, "metaalgieterij": 1, "draagconstructie": 1, "landbouw": 1, "tegenwoordig": 1, "glas": 1, "bij": 1, "naar": 2, "handel": 1, "de": 12, "ijzerwerk": 1, "den": 1, "pijlers": 1, "halfrond": 1, "ceres": 1, "eerste": 1, "c": 1, "&amp": 1, "1774": 1, "haag": 1, "heeft": 2, "architectenbureau": 1, "en": 4, "beelden": 2, "tweede": 1, "gesloten": 1, "ijzer-": 1, "voorgebouw": 1, "verrees": 1, "gelegen": 1, "korenbeurs": 3, "noodzakelijke": 1, "ontwerp": 1, "werd": 1, "voor": 1, "firma": 1, "enthoven": 1, "derde": 1, "een": 3, "bijzondere": 1, "symboliseren": 1, "driebeukige": 1, "groninger": 2, "co": 1, "uit": 1, "beursgebouw": 