INSERT INTO `Monument` VALUES(19043, 48, 'Paviljoen Welgelegen', 'Paviljoen Welgelegen (Dreef 3) . De uit Schotland afkomstige koopman-bankier Henry Hope liet dit L-vormige neoclassicistische buitenhuis in 1786-''89 bouwen ter plaatse van de door hem in 1769 gekochte hofstede Welgelegen. Het ontwerp is waarschijnlijk van Michel Triquetti, marineconsul van Sardini&euml;, en de bouw werd geleid door Jean Baptiste Dubois. Dit buiten werd in 1808 door koning Lodewijk Napoleon in gebruik genomen (tot 1810) en later door koning Willem I ter beschikking gesteld van zijn moeder, de prinses douairi&egrave;re Frederika Sophia Wilhelmina. Vanaf 1838 herbergde het enkele musea, waaronder vanaf 1871 de koloniale collectie van de Nederlandse Maatschappij tot bevordering van Nijverheid (in 1926 naar Amsterdam overgebracht). Sinds 1930 is hier het provinciehuis van Noord-Holland gevestigd (gerestaureerd circa 1989).', 52.372, 4.63039, 'Haarlem', 'Noord-Holland', 'Dreef', '3', '1785/8', 1785, 'Paviljoen Welgelegen', '{"michel": 1, "jean": 1, "nijverheid": 1, "beschikking": 1, "schotland": 1, "baptiste": 1, "door": 4, "amsterdam": 1, "koning": 2, "1769": 1, "1786-''89": 1, "1930": 1, "nederlandse": 1, "paviljoen": 2, "vanaf": 2, "gekochte": 1, "douairi&egrave": 1, "ontwerp": 1, "marineconsul": 1, "werd": 2, "noord-holland": 1, "bevordering": 1, "l-vormige": 1, "het": 3, "circa": 1, "moeder": 1, "bouwen": 1, "enkele": 1, "hem": 1, "buiten": 1, "genomen": 1, "afkomstige": 1, "triquetti": 1, "bouw": 1, "herbergde": 1, "3": 1, "uit": 1, "gevestigd": 1, "maatschappij": 1, "1810": 1, "plaatse": 1, "buitenhuis": 1, "sophia": 1, "waarschijnlijk": 1, "hier": 1, "1989": 1, "ter": 2, "welgelegen": 3, "hope": 1, "van": 7, "liet": 1, "haarlem": 1, "naar": 1, "gebruik": 1, "frederika": 1, "provinciehuis": 1, "hofstede": 1, "re": 1, "zijn": 1, "de": 6, "1808": 1, "sinds": 1, "tot": 2, "geleid": 1, "henry": 1, "dit": 2, "dreef": 1, "willem": 1, "neoclassicistische": 1, "musea": 1, "collectie": 1, "d