INSERT INTO `Monument` VALUES(25479, 60, 'Bibliotheca Thysiana', 'De Bibliotheca Thysiana (Rapenburg 25) , gebouwd in 1655 naar ontwerp van Arent van ''s-Gravesande, heeft een classicistische gevel met zandstenen ingangspoortje en op de verdieping een zandstenen ionische pilasterstelling en houten kruisvensters. Bij de bouw waren ook Willem van der Helm, Jan Jansz Pety en Willem Wijmoth betrokken. Deze &lsquo;tot publycke dienst der studie&rsquo; bestemde bibliotheek werd verwezenlijkt met een legaat van de geleerde Johannes Thysius (&dagger; 1653). De via een dubbele bordestrap en steektrap vanuit het voorhuis bereikbare bibliotheekzaal op de verdieping bevat nog de inrichting uit de bouwtijd met boekenkasten, een archiefkast, een leestafel en een boekenmolen.', 52.1588, 4.48479, 'Leiden', 'Zuid-Holland', 'Rapenburg', '25', '1654-1655', 1655, 'Bibliotheca Thysiana', '{"houten": 1, "via": 1, "thysius": 1, "arent": 1, "rapenburg": 1, "thysiana": 2, "ontwerp": 1, "werd": 1, "bibliotheca": 2, "dienst": 1, "het": 1, "waren": 1, "verwezenlijkt": 1, "pety": 1, "jan": 1, "gebouwd": 1, "deze": 1, "nog": 1, "op": 2, "een": 7, "ook": 1, "bordestrap": 1, "studie&rsquo": 1, "bibliotheek": 1, "bouw": 1, "publycke": 1, "25": 1, "1653": 1, "kruisvensters": 1, "uit": 1, "1655": 1, "johannes": 1, "jansz": 1, "geleerde": 1, "wijmoth": 1, "boekenkasten": 1, "bij": 1, "der": 2, "van": 4, "&dagger": 1, "voorhuis": 1, "bestemde": 1, "naar": 1, "&lsquo": 1, "verdieping": 2, "leestafel": 1, "de": 8, "bouwtijd": 1, "ingangspoortje": 1, "met": 3, "tot": 1, "bevat": 1, "inrichting": 1, "pilasterstelling": 1, "willem": 2, "betrokken": 1, "vanuit": 1, "bereikbare": 1, "classicistische": 1, "gevel": 1, "helm": 1, "archiefkast": 1, "dubbele": 1, "in": 1, "leiden": 1, "boekenmolen": 1, "heeft": 1, "ionische": 1, "steektrap": 1, "legaat": 1, "bibliotheekzaal": 1, "zandstenen": 2, "en": 5, "''s-gravesande": 1}');
INSERT INTO `Monument` VALUES(25653, 59, 'd''Heesterboom', 'Pakhuizen. In de 17de eeuw hadden veel huizen tevens een opslag- of pakhuisfunctie, zoals te zien is bij Hooigracht 5-7 en Herengracht 82. Rond 1650 geheel als pakhuis gebouwd is Oude Rijn 90 (met trapgevel). Het Graanmagazijn der Armen (Oude Rijn 44-46) werd in 1754 (gevelsteen) gebouwd als een dubbel pakhuis ter plaatse van het 15de-eeuwse Huiszittenhuis. Het links aangrenzende pand Oude Rijn 42 diende tot 1870 als broodbakkerij. In 1988 heeft men het complex verbouwd tot studentenhuisvesting. Een vergelijkbare brede afgeknotte topgevel als Oude Rijn 44 bezit het tot woonhuis verbouwde pakhuis Nieuwstraat 31a (circa 1700). Uit het midden van de 19de eeuw dateren de in sobere neoclassicistische vormen gebouwde pakhuizen Oude Rijn 36, met in de kroonlijst een olifantje op een console, en Lange Mare 60. Het pakhuis Nieuwstraat 43 uit 1863 heeft drie pakhuisdeuren boven elkaar. Het voorm. pakhuis Nieuwe Rijn 71 (circa 1870) kreeg gepleisterde lisenen en daklijst in de stijl van J.W. Schaap en het voorm. graanpakhuis Nieuwstraat 32 (circa 1875) is uitgevoerd in eclectische stijl. Iets jonger is het pakhuis Oude Rijn 89 uit 1904. Windmolens. In 1743 verrees op het Grote of Rijnsburgerbolwerk - ter plaatse van een voorganger uit 1667 - de korenmolen De Valk (2de Binnenvest-gracht 1) , een hoge ronde stellingmolen met een met dakleer beklede kap (gerestaureerd 1996). Als houtzaagmolen ingericht zijn de molens De Heesterboom (Haagweg 57) uit 1804 (gerestaureerd 1994) en De Herder (Haarlemmerweg 80), die in 1884 vanuit Amsterdam naar hier is overgebracht. Beide zijn stellingmolens met een houten onderbouw, een met riet gedekte achtzijdige romp en twee lage houten zijvleugels. Windmolen De Put (1ste Binnenvestgracht 11) is een replica uit 1987 van een gesloten houten standerdmolen uit 1640 van Jan Jansz de Put.', 52.1567, 4.47253, 'Leiden', 'Zuid-Holland', 'Haagweg', '57', '1856 / 1981 ', 1981, 'd''Heesterboom', '{"riet": 1, "houten": 3, "geheel": 1, "36": 1, "amsterdam": 1, "molens": 1, "onderbouw": 1, "of": 2, "17de": 1, "aangrenzende": 1, "19de": 1, "43": 1, "tevens": 1, "42": 1, "huizen": 1, "het": 11, "31a": 1, "pakhuis": 6, "ronde": 1, "gebouwd": 2, "kap": 1, "op": 2, "stijl": 2, "hooigracht": 1, "binnenvestgracht": 1, "2de": 1, "1904": 1, "gepleisterde": 1, "-": 2, "d''heesterboom": 1, "1": 1, "windmolens": 1, "1987": 1, "trapgevel": 1, "32": 1, "graanpakhuis": 1, "veel": 1, "jansz": 1, "hier": 1, "1988": 1, "lage": 1, "bij": 1, "der": 1, "complex": 1, "nieuwstraat": 3, "put": 2, "naar": 1, "gebouwde": 1, "standerdmolen": 1, "hadden": 1, "11": 1, "drie": 1, "eeuw": 2, "de": 12, "1996": 1, "twee": 1, "1994": 1, "1640": 1, "1700": 1, "vanuit": 1, "kroonlijst": 1, "elkaar": 1, "studentenhuisvesting": 1, "eclectische": 1, "armen": 1, "olifantje": 1, "90": 1, "verbouwde": 1, "oude": 6, "links": 1, "vergelijkbare": 1, "dakleer": 1, "zien": 1, "boven": 1, "leiden": 1, "heeft": 2, "overgebracht": 1, "opslag-": 1, "herengracht": 1, "houtzaagmolen": 1, "en": 6, "iets": 1, "zijvleugels": 1, "89": 1, "jonger": 1, "binnenvest-gracht": 1, "1ste": 1, "pakhuizen": 2, "gesloten": 1, "achtzijdige": 1, "44-46": 1, "dateren": 1, "haarlemmerweg": 1, "verrees": 1, "te": 1, "sobere": 1, "korenmolen": 1, "1863": 1, "verbouwd": 1, "dubbel": 1, "nieuwe": 1, "diende": 1, "werd": 1, "rijn": 7, "1667": 1, "82": 1, "jan": 1, "80": 1, "circa": 3, "replica": 1, "schaap": 1, "mare": 1, "brede": 1, "1754": 1, "pakhuisdeuren": 1, "een": 12, "kreeg": 1, "pakhuisfunctie": 1, "1650": 1, "console": 1, "uit": 7, "bezit": 1, "hoge": 1, "plaatse": 2, "71": 1, "heesterboom": 1, "beide": 1, "ter": 2, "ingericht": 1, "van": 6, "romp": 1, "5-7": 1, "1743": 1, "woonhuis": 1, "57": 1, "valk": 1, "lisenen": 1, "stellingmolen": 1, "daklijst": 1, "midden": 1, "zijn": 2, "1884": 1, "gevelsteen": 1, "vormen": 1, "met": 6, "rond": 1, "voorganger": 1, "tot": 3, "broodbakkerij": 1, "1804": 1, "grote": 1, "topgevel": 1, "als"