INSERT INTO `Monument` VALUES(27454, 66, 'Onze-Lieve-Vrouwebasiliek', 'De R.K.O.L.-Vrouwebasiliek (O.L.-Vrouweplein 9) is een grotendeels in kolenzandsteen opgetrokken driebeukige, basilicale kruiskerk voorzien van een rond gesloten kooromgang met galerij. Het koor wordt geflankeerd door twee gedrongen torens voorzien van een stenen spits met frontalen en twee rond gesloten zijkapellen van het transept. Verder heeft de kerk twee pseudotransepten en een zeer hoog en massief westwerk tussen twee ronde traptorens met spits.', 50.8473, 5.69371, 'Maastricht', 'Limburg', 'Onze Lieve Vrouweplein', '9', 'Vanaf 11e eeuw', 1100, 'Basiliek van Onze-Lieve-Vrouw-Tenhemelopneming (Maastricht)', '{"zeer": 1, "r.k.o.l.-vrouwebasiliek": 1, "opgetrokken": 1, "van": 3, "gedrongen": 1, "voorzien": 2, "basilicale": 1, "o.l.-vrouweplein": 1, "gesloten": 2, "geflankeerd": 1, "door": 1, "kruiskerk": 1, "westwerk": 1, "kerk": 1, "kolenzandsteen": 1, "de": 2, "tussen": 1, "rond": 2, "met": 3, "twee": 4, "koor": 1, "grotendeels": 1, "wordt": 1, "het": 2, "verder": 1, "hoog": 1, "pseudotransepten": 1, "ronde": 1, "is": 1, "een": 4, "onze-lieve-vrouwebasiliek": 1, "kooromgang": 1, "transept": 1, "in": 1, "massief": 1, "frontalen": 1, "driebeukige": 1, "galerij": 1, "heeft": 1, "torens": 1, "maastricht": 1, "traptorens": 1, "en": 3, "9": 1, "spits": 2, "stenen": 1, "zijkapellen": 1}');
INSERT INTO `Monument` VALUES(27700, 64, 'Spaans Gouvernement nu Museum aan het Vrijthof', 'Het voorm. Spaans Gouvernement (Vrijthof 18) , nu Museum Spaans Gouvernement, kwam voort uit het huis van Johannes Fraybart, kanunnik van het St.-Servaaskapittel. Hij schonk het pand in 1333 aan de Brabantse hertog Jan III. Hertogin Johanna stond het in 1397 af aan het Servaaskapittel als behuizing voor de proost onder beding dat haar opvolgers hier bij hun bezoeken aan de stad konden verblijven. Ter gelegenheid van het verblijf van keizer Karel V in 1520 werd het rechter deel van de oorspronkelijk in vakwerk uitgevoerde verdieping in mergelsteen herbouwd en voorzien van drie laat-gotische vensters. De boogvelden zijn versierd met de keizerskroon, gekroonde Herculeszuilen en een banderol met de keizerlijke spreuk &lsquo;Plus Oultre&rsquo; (Nog Verder); het middenvenster is gedecoreerd met de Habsburgse adelaar met op de borst het gedeelde wapen van Habsburg en Castili&euml;. Tekststenen tussen de vensters verwijzen naar Philips de Schone, de vader van Karel V. Voor het bezoek van de keizer en zijn zuster, landvoogdes Maria van Hongarije, in 1545-''46, kreeg de gevel aan de binnenplaats een arcade in vroege renaissance-stijl met vijf rondbogen op balusterzuilen, voorzien van kapitelen met gestileerde maskers en monsterdieren. Bij de doorgang werd een triomfboogversiering aangebracht met medaillonportretten van Karel V en Maria van Hongarije. Het kleine, beschadigde medaillon in het midden stelt vermoedelijk Philips II voor, die in 1550 enige tijd in het gebouw verbleef.', 50.8484, 5.68877, 'Maastricht', 'Limburg', 'Vrijthof', '18', 'eerste helft 16e eeuw e.v.', 1600, 'Spaans Gouvernement', '{"nu": 2, "tekststenen": 1, "fraybart": 1, "iii": 1, "behuizing": 1, "laat-gotische": 1, "habsburg": 1, "landvoogdes": 1, "gestileerde": 1, "1520": 1, "gekroonde": 1, "het": 15, "aangebracht": 1, "deel": 1, "plus": 1, "nog": 1, "op": 2, "versierd": 1, "binnenplaats": 1, "museum": 2, "aan": 