INSERT INTO `Monument` VALUES(46869, 76, 'Van Nellefabriek', 'De voorm. Van Nellefabriek (Van Nelleweg 1) , het bekendste Nederlandse voorbeeld van een functionalistisch fabrieksgebouw, kwam in 1925-''30 tot stand naar ontwerp van L.C. van der Vlugt (en J.A. Brinkman) in opdracht van directeur C.H. van der Leeuw. Op basis van het toenmalige fabricageproces ontstond een complex met fabrieksdelen voor tabak (achtlaags), koffie (vijflaags) en thee (drielaags) en aan de voorzijde een concaaf kantoorgebouw met haakse vleugel. Luchtbruggen verbinden het kantoorgebouw en het pakhuis aan de Schie-zijde met de tabaksfabriek, die wordt bekroond door een rond uitzichtspaviljoen. De gebouwen hebben betonvloeren op betonnen paddestoelkolommen en vliesgevels met stroken van smalle stalen ramen. Voor de constructie was J.G. Wiebenga verantwoordelijk en bij de tuinaanleg was M. Ruys betrokken. Uitbreidingen volgden in 1942-''43 en 1967. Na de verkoop in 1998 is de fabriek verbouwd tot bedrijfsverzamelgebouw.', 51.9229, 4.4347, 'Rotterdam', 'Zuid-Holland', 'Van Nelleweg', '1', '1925-1930', 1930, 'Van Nellefabriek', '{"tuinaanleg": 1, "tabak": 1, "betonvloeren": 1, "basis": 1, "smalle": 1, "uitbreidingen": 1, "bedrijfsverzamelgebouw": 1, "door": 1, "verbouwd": 1, "nederlandse": 1, "ontwerp": 1, "haakse": 1, "ontstond": 1, "het": 4, "drielaags": 1, "pakhuis": 1, "voor": 2, "constructie": 1, "fabriek": 1, "verbinden": 1, "fabricageproces": 1, "rotterdam": 1, "een": 4, "op": 2, "tabaksfabriek": 1, "fabrieksgebouw": 1, "vleugel": 1, "bekendste": 1, "aan": 2, "luchtbruggen": 1, "1925-''30": 1, "1": 1, "kantoorgebouw": 2, "bekroond": 1, "voorzijde": 1, "concaaf": 1, "kwam": 1, "thee": 1, "bij": 1, "der": 2, "van": 10, "complex": 1, "nelleweg": 1, "vlugt": 1, "naar": 1, "toenmalige": 1, "ruys": 1, "paddestoelkolommen": 1, "was": 2, "betonnen": 1, "de": 9, "rond": 1, "met": 4, "1998": 1, "stroken": 1, "vliesgevels": 1, "tot": 2, "schie-zijde": 1, "nellefabriek": 2, "wordt": 1, "die": 1, "fabrieksdelen": 1, "hebben": 1, "leeuw": 1, "directeur": 1, "betrokken": 1, "voorm": 1, "brinkman": 1, "uitzichtspaviljoen": 1, "j.a": 1, "voorbeeld": 1, "verkoop": 1, "ramen": 1, "c.h": 1, "is": 1, "j.g": 1, "1967": 1, "stalen": 1, "opdracht": 1, "1942-''43": 1, "volgden": 1, "functionalistisch": 1, "vijflaags": 1, "m": 1, "wiebenga": 1, "in": 4, "achtlaags": 1, "koffie": 1, "verantwoordelijk": 1, "na": 1, "stand": 1, "l.c": 1, "en": 7, "gebouwen": 1}');
