INSERT INTO `Monument` VALUES(332550, 2, 'Kasteel Amerongen', 'Kasteel Amerongen (Drostestraat 20) is een vrijwel vierkant bouwwerk uit 1674-''80. Gelegen in de uiterwaarden van de Nederrijn wordt het terrein afgesloten door een kade. Binnen die kade wordt het huis omringd door een binnen- en een buitengracht. Het staat op de plaats van een in 1286 door Borre en Diederic van Amerongen gesticht kasteel, dat door de Fransen in 1673 werd verwoest. Godard van Reede en zijn vrouw Margaretha Turnor lieten in 1673 het huidige huis bouwen op de oude fundamenten en een deel van het muurwerk van de zuidwesttoren. De architect is niet bekend. Meester-timmerman Hendrick Geurtsz. Schut moet als uitvoerend bouwmeester worden beschouwd.', 51.9954, 5.45853, 'Amerongen', 'Utrecht', 'Drostestraat', '20', '1674-1679', 1679, 'Kasteel Amerongen', '{"uitvoerend": 1, "vrouw": 1, "muurwerk": 1, "door": 4, "gelegen": 1, "lieten": 1, "werd": 1, "beschouwd": 1, "het": 5, "deel": 1, "bouwwerk": 1, "vrijwel": 1, "terrein": 1, "bouwen": 1, "een": 6, "op": 2, "1286": 1, "godard": 1, "amerongen": 4, "architect": 1, "dat": 1, "zuidwesttoren": 1, "uit": 1, "hendrick": 1, "moet": 1, "schut": 1, "kade": 2, "margaretha": 1, "van": 6, "plaats": 1, "huidige": 1, "turnor": 1, "bekend": 1, "omringd": 1, "binnen-": 1, "nederrijn": 1, "vierkant": 1, "buitengracht": 1, "zijn": 1, "drostestraat": 1, "reede": 1, "de": 7, "geurtsz": 1, "20": 1, "verwoest": 1, "als": 1, "wordt": 2, "die": 1, "1674-''80": 1, "worden": 1, "is": 2, "meester-timmerman": 1, "afgesloten": 1, "huis": 2, "oude": 1, "borre": 1, "staat": 1, "binnen": 1, "in": 4, "gesticht": 1, "uiterwaarden": 1, "kasteel": 3, "niet": 1, "fransen": 1, "fundamenten": 1, "diederic": 1, "1673": 2, "bouwmeester": 1, "en": 4}');
